INSERT INTO `ab_blogs` (`blogID`, `blogTitle`, `description`, `category`, `blogImage`, `blogTemplate`, `pageCode`, `pageCss`, `pageContent`, `createdDate`, `createdBy`, `ModifiedDate`, `modifiedBy`, `status`, `blogLink`, `blogSubTitle`, `metaKeywords`, `metaDesc`) VALUES
(16, 'Are you up for a challenge? Here is where we need your help', 'We don\'t grow when things are easy we grow when we face challenges\n\nAt KPIT Sparkle, over the past 6 years, we have been a witness to the brightest minds of the country showcasing their potential and innovation at an inspirational level.\n\nThese students come up with out-of-the-box ideas and solutions, and we\'re happy to do our bit in facilitating these new ways of doing things. Over this time, undergraduate, post-graduate, and Ph.D. students from Science, Engineering, Design or Management colleges in India have grabbed the platform to bring their ideas to life.\n\nBut what\'s success without a little bit of challenge? This year, we\'re looking to challenge students, professors, and faculty through an exciting contest where they can showcase their imagination, skills, and initiative in the areas of Mobility and Energy.\n\nWhat is the contest?\nA KPIT Sparkle first this year, the \'i can crack IT\' innovation contest gives participants an opportunity to solve real-world problems. They can choose from a range of problem statements across various categories within Mobility and Energy and try to come up with the best solution. Since all the required links, data, and informational resources are provided by KPIT, all the participants have to do is to rack their brains and come up with out-of-the-box solutions that are modern and innovative. Students can add one faculty as a team member, and also file for a shared patent with KPIT for the solution they provide.\n\nMind you, these are not easy or run-of-the-mill problems. These are problems that our in-house experts have already grappled with and found challenging. Challenging enough, in fact, for them to have to turn to you, bright young minds with a request for help.\n\n\nHow does it work?\nThe \'i can crack IT\' contest is for all students of undergraduate, post-graduate, and Ph.D. courses from Science, Engineering, Design and Management colleges and universities across India. Students can participate either as an individual (=1 member) or as a team (=3 members including a Professor). The good news is, there is no restriction on team configuration team members can be from the same or different department(s), branches, and colleges.\n\nOnce a student registers for \'i can crack IT\', he/she can opt for a category of their choice and pick from a list of problem statements. Once a statement has been selected, all the details of the problem are provided, along with important deliverables and milestones.\n\nWhat is the theme?\nAs fossil fuels start losing their sheen, renewable sources of energy pick up steam, and the trend of automation becomes a mainstay, there is a lot happening in the energy sector across the world. Transportation and Mobility is being similarly transformed.\n\nTo keep pace with the myriad changes happening in the sector, KPIT Sparkle focusses on the theme of Mobility and Energy for the future. If you have an inclination towards modernizing these sectors, there are a number of problem statements you can choose from, and submit your solution to win exciting prizes:\n\nAutomotive cybersecurity\no Device authentication mechanism over LIN\no Fuzz testing on LIN-based implementations\no Identification and validation of vulnerabilities using penetration testing\no Security assessment of secure flashing and bootloader\no Security assessment of autonomous vehicles\nConnected Vehicles\no Biker to biker communication\no Optimum routing for on-demand delivery\nInfotainment\no Automotive Init\no Qt Quick Optimization\no App Armor SMACK SE Linux Evaluation for KIVI\no Calendar Integration Using Konnect\no HCI Snoop Log\no Intelligent Testing System\no KD Bus Migration\no MFI Trace Parser Tool\nAutonomous driving\no Design and develop efficient multiple object tracking algorithm\no Automatic number plate recognition (ANPR) for different fonts and non-roman scripts\no Gaze, micro-gestures and hand-signal detection of law-enforcement officers and other road-users\no Detection of kerb-side parking-slot with poor kerb-side/lane-markings\nElectric Vehicle\no Motor efficiency\no State of health\no Optimization of battery thermal management\nPowertrain\no Fusion of physics and machine learning\nAlternative powertrain\no Solid state battery\no Hydrogen storage\no Hydrogen purification\nAutomotive diagnostics\nTools\no Expense recognition software challenge\no Test automation tools\nAnalytics\no EV schedule generation and optimization\nHow you can participate\nParticipating in \'i can crack IT\' is extremely easy all you have to do is, log on to https://sparkle.kpit.com, register by filling in all relevant information and select the problem statement you want to address. Once you receive the problem statement document, you need to carefully go through it to understand the deliverables and milestones that you will have to commit to. You are then expected to submit the expected output mentioned in Milestone 1. All the submitted ideas and solutions will then be evaluated for Milestone 2. Those teams that complete the second milestone will then compete for the awards.\n\nPull up your socks\nAs the world progresses at lightning fast speed, the younger generation (i.e. you!) is looking for opportunities to challenge itself and emerge as a winner. And that\'s the opportunity that KPIT Sparkle\'s \'i can crack IT\' offers.\n\nBy bringing aboard students from different branches and colleges across India, the innovation platform has been set. All that remains now is to get solutions to some of the most complex problems of tomorrow. And that\'s where you come in.\n\nSo, if taking up challenges is your forte, \'i can crack IT\' is your gateway to success. Not only can you choose a problem from your area of interest, but you can also enjoy joint IP opportunities with KPIT, get some much-needed industry exposure, and win awards of INR 50k each.\n\nAS they say, don\'t limit your challenges challenge your limits!\nFor more information, drop in an email at KPITSparkle2020@kpit.com', '6', 'blogImage821.jpg', 'temp1', '&lt;div class=&quot;rowData ui-sortable-handle&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1623213655959_15&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1623247156625&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData ui-sortable-handle container-fluid ws-row-data-1&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1623213655959_15&quot; class=&quot;col-lg-12 ws-1623213655959_15&quot;&gt;&lt;div id=&quot;ws_1623247156625&quot; class=&quot;ws_1623247156625&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-06-07', 1, '2021-09-06', 1, 'delete', 'Are_you_up_for_a_challenge_Here_is_where_we_need_your_help', 'Are you up for a challenge? Here is where we need your help', 'Are you up for a challenge? Here is where we need your ', 'Are you up for a challenge? Here is where we need your help'),
(17, 'The 5 Biggest Energy Opportunities in India Today', 'It is speculated that India\'s energy consumption will grow 4.2% per year over the next 20 years. If so, we will overtake China as the world\'s largest energy market by 2030.\n\nOf course, that rate of growth in energy demands comes with its own set of challenges. The task is not just how to produce more energy. It\'s how to do so responsibly? This is why the Indian Government is focusing on the sector announcing a number of energy initiatives. This includes the promotion of energy efficiency and increasing the number of clean energy resources.\n\nEven scientists and engineers are working hard to figure out different ways to manage the product, distribution, and management of energy, be it to schools, homes, businesses, cities, villages and so on. This is where they are using new technologies, which not only makes energy more efficient but also more accessible than ever before. There are challenges aplenty that demand smart solutions. Let\'s take a look at some of the biggest energy opportunities in India today:\n1. Zero-Emission from power generation After being the focus for auto manufacturers, zero-Emissions is becoming quite the popular buzz-word in industrial circles. Innovations such as a generator that can eliminate CO2 are catching the eye. This generator produces power at a much lower cost. The best part is that it operates within all the rules and regulations governing greenhouse emissions. The underlying technology uses oxygen to burn natural gas. It provides an alternative source of energy to those employed by power plants. While this is just one of the ways to go about zero-emissions, there is plenty of scope to reduce CO2 and therefore, reduce the carbon footprint of industries.\n\n2. Grid-Scale Energy Storage Battery-based energy storage is another energy opportunity that is making headlines. It allows electricity to be stored and delivered within milliseconds, reduces grid instability and enables more energy to be captured and delivered on demand.\nA major step in this direction was taken when India got its first ever grid-scale battery energy storage system. The 10 MW grid-connected system, is owned by AES and Mitsubishi Corporation and is all set to pave the way for wider adoption of grid-scale energy storage technology across India. The best part is that this battery-based energy storage uses no water and is linked to zero-emissions. With India aiming to set up 175 GW of renewable energy capacity by 2022, a more accessible and cost-effective way to store that energy could prove extremely helpful. The scope here is limitless and the wider vision is to harness and integrate solar and wind energy resources into the country\'s grid for delivering reliable and responsible power supply to all consumers.\n\n3. Recycling Rainwater Several Indian cities are facing acute water shortage. This is a crisis that goes beyond the dry summer spells. One of the ways to overcome this is to recycle rainwater. If you are wondering what conservation of water has to do with energy? Well, apart from being a laudable goal in itself, water has for long also played a key role in energy generation. The Norwich University for instance through its online civil engineering degree program is teaching students to explore the myriad possibilities of using rainwater as an energy resource.\n\n4. Solar Power - India has the ability to generate over 1,900 billion units of solar power annually, which is equal to the entire annual power demand until 2030. The increasing efforts to increase the share of this renewable energy is behind the ever-growing solar power generation over the past few years. The best part is that the country receives annual solar radiation of more than 5000 trillion kWh, which is a huge amount of energy that can be harnessed. Currently, India\'s solar energy sector relies heavily on imported products. This is an obstacle that can be overcome with new innovations in creating domestically manufactured products for use across the generation and storage of solar power.\n\n5. Hydel Power In the late 2000s, hydroelectric power was considered as a sustainable and a renewable alternative to both coal and gas-based electricity in the country. This led to the setting up of a number of hydel plants. However, since 2008, hydropower started taking a backseat. Today, India has 4,500 MW of hydel projects with a capacity of less than 25 MW each and the hydropower potential (more than 25 MW) of the country stands at over 1,45,000 MW. To take things forward, innovations are needed at a variety of stages. This includes upstream (literally) in recharging the river systems so that they can continue to flow and generate power. There is also room for innovations in improving the storage of water as well as of the generated power. When brought together, these can be helpful to drive more intelligent use of hydel power in the press for renewable energy.\n\nThese are but some of the energy opportunities that exist in India today. As you can see, the scope is vast. The scale is huge. And the ecosystem is connected. As the youth who will inherit the nation, what is your take on these opportunities? What do you think can drive more innovations? Share your ideas with us. We are all ears!', '6', 'blogImage551.jpg', '', '&lt;div class=&quot;rowData ui-sortable-handle&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630917035831_89&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630917037982&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;It is speculated that India\'s energy consumption will grow&amp;nbsp;&lt;u&gt;4.2% per year&lt;/u&gt;&amp;nbsp;over the next 20 years. If so, we will overtake China as the world\'s largest energy market by 2030.&lt;/p&gt;&lt;p&gt;Of course, that rate of growth in energy demands comes with its own set of challenges. The task is not just how to produce more energy. It\'s how to do so responsibly? This is why the Indian Government is focusing on the sector announcing a number of energy initiatives. This includes the promotion of energy efficiency and increasing the number of clean energy resources.&lt;/p&gt;&lt;p&gt;Even scientists and engineers are working hard to figure out different ways to manage the product, distribution, and management of energy, be it to schools, homes, businesses, cities, villages and so on. This is where they are using new technologies, which not only makes energy more efficient but also more accessible than ever before. There are challenges aplenty that demand smart solutions. Let\'s take a look at some of the biggest energy opportunities in India today:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;1. Zero-Emission from power generation&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;After being the focus for auto manufacturers, zero-Emissions is becoming quite the popular buzz-word in industrial circles. Innovations such as a generator that can eliminate CO2 are catching the eye. This generator produces power at a much lower cost. The best part is that it operates within all the rules and regulations governing greenhouse emissions. The underlying technology uses oxygen to burn natural gas. It provides an alternative source of energy to those employed by power plants. While this is just one of the ways to go about zero-emissions, there is plenty of scope to reduce CO2 and therefore, reduce the carbon footprint of industries.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;2. Grid-Scale Energy Storage&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;u&gt;Battery-based energy storage&lt;/u&gt;&amp;nbsp;is another energy opportunity that is making headlines. It allows electricity to be stored and delivered within milliseconds, reduces grid instability and enables more energy to be captured and delivered on demand.&lt;/p&gt;&lt;p&gt;A major step in this direction was taken when India got its first ever grid-scale battery energy storage system. The 10 MW grid-connected system, is owned by&amp;nbsp;&lt;u&gt;AES&lt;/u&gt;&amp;nbsp;and&amp;nbsp;&lt;u&gt;Mitsubishi Corporation&lt;/u&gt;&amp;nbsp;and is all set to pave the way for wider adoption of grid-scale energy storage technology across India. The best part is that this battery-based energy storage uses no water and is linked to zero-emissions. With India aiming to set up 175 GW of renewable energy capacity by 2022, a more accessible and cost-effective way to store that energy could prove extremely helpful. The scope here is limitless and the wider vision is to harness and integrate solar and wind energy resources into the country\'s grid for delivering reliable and responsible power supply to all consumers.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;3. Recycling Rainwater&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Several Indian cities are facing acute water shortage. This is a crisis that goes beyond the dry summer spells. One of the ways to overcome this is to recycle rainwater. If you are wondering what conservation of water has to do with energy? Well, apart from being a laudable goal in itself, water has for long also played a key role in energy generation. The Norwich University for instance through its&amp;nbsp;&lt;u&gt;online civil engineering degree&lt;/u&gt;&amp;nbsp;program is teaching students to&amp;nbsp;&lt;u&gt;explore the myriad possibilities&lt;/u&gt;&amp;nbsp;of using rainwater as an energy resource.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;4. Solar Power&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;India has the ability to generate over 1,900 billion units of solar power annually, which is equal to the entire annual power demand until 2030. The increasing efforts to increase the share of this renewable energy is behind the ever-growing solar power generation over the past few years. The best part is that the country receives annual solar radiation of more than 5000 trillion kWh, which is a huge amount of energy that can be harnessed. Currently, India\'s solar energy sector relies heavily on imported products. This is an obstacle that can be overcome with new innovations in creating domestically manufactured products for use across the generation and storage of solar power.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;5. Hydel Power&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;In the late 2000s, hydroelectric power was considered as a sustainable and a renewable alternative to both coal and gas-based electricity in the country. This led to the setting up of a number of hydel plants. However, since 2008, hydropower started taking a backseat. Today, India has 4,500 MW of hydel projects with a capacity of less than 25 MW each and the hydropower potential (more than 25 MW) of the country stands at over 1,45,000 MW. To take things forward, innovations are needed at a variety of stages. This includes upstream (literally) in recharging the river systems so that they can continue to flow and generate power. There is also room for innovations in improving the storage of water as well as of the generated power. When brought together, these can be helpful to drive more intelligent use of hydel power in the press for renewable energy.&lt;/p&gt;&lt;p&gt;These are but some of the energy opportunities that exist in India today. As you can see, the scope is vast. The scale is huge. And the ecosystem is connected. As the youth who will inherit the nation, what is your take on these opportunities? What do you think can drive more innovations? Share your ideas with us. We are all ears!&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData ui-sortable-handle container-fluid ws-row-data-1&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630917035831_89&quot; class=&quot;col-lg-12 ws-1630917035831_89&quot;&gt;&lt;div id=&quot;ws_1630917037982&quot; class=&quot;ws_1630917037982&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;It is speculated that India\'s energy consumption will grow&amp;nbsp;&lt;u&gt;4.2% per year&lt;/u&gt;&amp;nbsp;over the next 20 years. If so, we will overtake China as the world\'s largest energy market by 2030.&lt;/p&gt;&lt;p&gt;Of course, that rate of growth in energy demands comes with its own set of challenges. The task is not just how to produce more energy. It\'s how to do so responsibly? This is why the Indian Government is focusing on the sector announcing a number of energy initiatives. This includes the promotion of energy efficiency and increasing the number of clean energy resources.&lt;/p&gt;&lt;p&gt;Even scientists and engineers are working hard to figure out different ways to manage the product, distribution, and management of energy, be it to schools, homes, businesses, cities, villages and so on. This is where they are using new technologies, which not only makes energy more efficient but also more accessible than ever before. There are challenges aplenty that demand smart solutions. Let\'s take a look at some of the biggest energy opportunities in India today:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;1. Zero-Emission from power generation&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;After being the focus for auto manufacturers, zero-Emissions is becoming quite the popular buzz-word in industrial circles. Innovations such as a generator that can eliminate CO2 are catching the eye. This generator produces power at a much lower cost. The best part is that it operates within all the rules and regulations governing greenhouse emissions. The underlying technology uses oxygen to burn natural gas. It provides an alternative source of energy to those employed by power plants. While this is just one of the ways to go about zero-emissions, there is plenty of scope to reduce CO2 and therefore, reduce the carbon footprint of industries.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;2. Grid-Scale Energy Storage&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;u&gt;Battery-based energy storage&lt;/u&gt;&amp;nbsp;is another energy opportunity that is making headlines. It allows electricity to be stored and delivered within milliseconds, reduces grid instability and enables more energy to be captured and delivered on demand.&lt;/p&gt;&lt;p&gt;A major step in this direction was taken when India got its first ever grid-scale battery energy storage system. The 10 MW grid-connected system, is owned by&amp;nbsp;&lt;u&gt;AES&lt;/u&gt;&amp;nbsp;and&amp;nbsp;&lt;u&gt;Mitsubishi Corporation&lt;/u&gt;&amp;nbsp;and is all set to pave the way for wider adoption of grid-scale energy storage technology across India. The best part is that this battery-based energy storage uses no water and is linked to zero-emissions. With India aiming to set up 175 GW of renewable energy capacity by 2022, a more accessible and cost-effective way to store that energy could prove extremely helpful. The scope here is limitless and the wider vision is to harness and integrate solar and wind energy resources into the country\'s grid for delivering reliable and responsible power supply to all consumers.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;3. Recycling Rainwater&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Several Indian cities are facing acute water shortage. This is a crisis that goes beyond the dry summer spells. One of the ways to overcome this is to recycle rainwater. If you are wondering what conservation of water has to do with energy? Well, apart from being a laudable goal in itself, water has for long also played a key role in energy generation. The Norwich University for instance through its&amp;nbsp;&lt;u&gt;online civil engineering degree&lt;/u&gt;&amp;nbsp;program is teaching students to&amp;nbsp;&lt;u&gt;explore the myriad possibilities&lt;/u&gt;&amp;nbsp;of using rainwater as an energy resource.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;4. Solar Power&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;India has the ability to generate over 1,900 billion units of solar power annually, which is equal to the entire annual power demand until 2030. The increasing efforts to increase the share of this renewable energy is behind the ever-growing solar power generation over the past few years. The best part is that the country receives annual solar radiation of more than 5000 trillion kWh, which is a huge amount of energy that can be harnessed. Currently, India\'s solar energy sector relies heavily on imported products. This is an obstacle that can be overcome with new innovations in creating domestically manufactured products for use across the generation and storage of solar power.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;5. Hydel Power&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;In the late 2000s, hydroelectric power was considered as a sustainable and a renewable alternative to both coal and gas-based electricity in the country. This led to the setting up of a number of hydel plants. However, since 2008, hydropower started taking a backseat. Today, India has 4,500 MW of hydel projects with a capacity of less than 25 MW each and the hydropower potential (more than 25 MW) of the country stands at over 1,45,000 MW. To take things forward, innovations are needed at a variety of stages. This includes upstream (literally) in recharging the river systems so that they can continue to flow and generate power. There is also room for innovations in improving the storage of water as well as of the generated power. When brought together, these can be helpful to drive more intelligent use of hydel power in the press for renewable energy.&lt;/p&gt;&lt;p&gt;These are but some of the energy opportunities that exist in India today. As you can see, the scope is vast. The scale is huge. And the ecosystem is connected. As the youth who will inherit the nation, what is your take on these opportunities? What do you think can drive more innovations? Share your ideas with us. We are all ears!&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-06-08', 1, '2021-11-20', 1, 'delete', 'The_5_Biggest_Energy_Opportunities_in_India_Today', 'The 5 Biggest Energy Opportunities in India Today', 'The 5 Biggest Energy Opportunities in India Today', 'The 5 Biggest Energy Opportunities in India Today');
INSERT INTO `ab_blogs` (`blogID`, `blogTitle`, `description`, `category`, `blogImage`, `blogTemplate`, `pageCode`, `pageCss`, `pageContent`, `createdDate`, `createdBy`, `ModifiedDate`, `modifiedBy`, `status`, `blogLink`, `blogSubTitle`, `metaKeywords`, `metaDesc`) VALUES
(18, 'What\'s new in KPIT Sparkle this year?', 'It\'s not just about ideas it\'s about making ideas happen. If you have an idea, and if you want to bring it to life, KPIT Sparkle is the platform you\'ve been waiting for.\n\nHaving been around for 6 years now, KPIT Sparkle has been a key milestone on the road to shape the innovations of the future. And what better way to do this, than by getting students from undergraduate, post-graduate and Ph.D. courses on board from colleges across India and encourage innovative thinking?\n\nBy bringing the industry and academia together, we encourage students and faculty to come up with innovative ideas on the most important topics of today. Students from Science, Engineering, Design, and Management streams are given the opportunity to identify a real-life use-case or problem, develop a solution and comprehensively demonstrate it through a working prototype.\nA quick recap\n\nSince the past 6 years, KPIT Sparkle has successfully been running what has now become the \"i Innovate\" contest. Students from colleges across India are given the golden opportunity to submit innovative and out-of-the-box ideas across a wide range of topics. They can select their own problem statement, propose solutions and submit their ideas to the contest. \"i Innovate\" not only gives students the platform to solve problems related to specific areas within the mobility and energy space, it also awards them with lucrative awards such as IP ownership opportunities, incubation opportunities, monetary benefits, as well as employment opportunities. What\'s more, students get the chance to interact with and seek advice from the great minds and experts of the industry and academia, who judge the projects during the contest. Students also get the chance to work on research projects of their interest within the KPIT family.\nWhat\'s new in 2020\n\nWith so many advancements happening in the energy sector, our focus this year is on \"Mobility and Energy of the Future\". Through the \"i Innovate\" contest, students can propose a problem statement in the area of Mobility and Energy and offer their innovative solutions. This year, the categories under mobility include electric vehicles, hybrid electric, hydrogen fuel cell vehicles, machine learning and Artificial Intelligence for electric vehicles, telematics for 2/4 wheelers, solutions for improving road safety, shared mobility, and sensors & actuators for automotive. And the categories under energy include energy storage technologies, energy generation technologies, and renewable energy solutions. While the \"i Innovate\" contest will run as previously, this year, we\'re also introducing an exciting new contest called \"i can crack IT\". A contest related to real-world industrial problems, \"i can crack IT\" provides participants with a problem statement and encourages them to come up with the best solution. All the required environment, useful links, and access to data available for research will be provided by KPIT. Students can add one faculty as a team member, and also file for a joint patent for their solution with KPIT. Since mobility and energy are the key areas we work on, there are specific areas where we need help. Through \"i can crack IT\", we are encouraging students, as well as faculty, to come up with ideas, and help us solve problems. This year, the categories for \"i can crack IT\" range from automotive cyber security, connected vehicles, and infotainment to autonomous driving, electric vehicles, powertrain, alternative powertrain, automotive diagnostics, tools, and analytics. Once a student registers for \"i can crack IT\", he/she can choose any category of interest. Once the problem statement is selected, he/she will receive a document with all the details about the problem. \"i can crack IT\" offers lucrative internship opportunities for 3rd-year undergraduate and 1st-year post-graduate students, as well as joint IP opportunities with KPIT. With 20 awards of INR 50k each, it also offers an industry exposure program to professors who reach the first milestone. \"i Innovate\" winners stand the chance to win amounts ranging from 10 lakhs to 1 lakh for their innovative solutions. Are you up for it? How many times have you come up with an innovative idea, but failed to build a prototype simply because you did not have the right platform or the support to bring it to life? With KPIT Sparkle, that will never happen again. A team of experts from industry and academia will handhold you throughout the journey of your idea from concept to prototyping. If you are an undergraduate, post-graduate or Ph.D. student from any Science, Engineering, Design or Management college in India, if you\'re up for challenges, and if you have the knack of solving problems in the area of Mobility and Energy, register for any of the two exciting contests, get rewarding offers, and allow your bright mind to sparkle. With 40,000+followers on Facebook and more than 66,600 impressions on Twitter, KPIT Sparkle is extremely visible. It has successfully been able to reach out to students across the country with its innovation contests. For more information, you can get in touch at KPITSparkle2020@kpit.com', '6', '', '', '&lt;div class=&quot;rowData ui-sortable-handle&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630913797824_6&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630913799359&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Opportunity does not come gift wrapped. You must take risks. But what if we told you that we\'ve got an opportunity on the offering and there are no risks attached? At best, the most risk you\'ll have to take is to get out of your comfort zone and the spectrum of excuses that are keeping you from taking your innovative idea to success. Before you dismiss this as a \'too good to be true\' kind of claim, read on. This opportunity that we are talking about is KPIT Sparkle. Since its inception in 2015, KPIT Sparkle, a one of a kind an innovation contest, has provided science and engineering students from across India, a platform to present innovative ideas related to the field of energy and transportation to solve real-world problems. The competition is open to all students from an undergraduate level to Ph.D. While KPIT sparkle is a competition, it is quite unlike regular contests. There is an award, and a handsome one, but this competition moves beyond awards. So let\'s begin with the scale of the program. In 2015, the first edition, 100 colleges participated in the contest which rose to 1121 in the 5th edition. 22150 students participated in this program in 2019 submitting 2065 ideas. While the competition is getting tougher owing to its rising popularity, here\'s a look at what all you could win.&lt;/span&gt;&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot; data-row-type=&quot;container&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot; data-meta-css=&quot;{&amp;quot;border-style&amp;quot;:&amp;quot;solid&amp;quot;}&quot;&gt;&lt;div id=&quot;ws-1630913832671_3&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot; data-meta-css=&quot;{&amp;quot;border-style&amp;quot;:&amp;quot;dashed&amp;quot;,&amp;quot;border-color&amp;quot;:&amp;quot;#000000&amp;quot;}&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630913839008&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot; style=&quot;position: relative; left: 0px; top: 0px;&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Solve real-world problems Let\'s talk about opportunity first. This year along with the \'i Innovate\' contest, we are hosting another contest called \'i can crack IT\'. The \'i Innovate\' contest looks for valid and innovative ideas in the area of \'mobility and energy\'. This year\'s theme for the same is \'Mobility &amp;amp; Energy for the Future\'. The students can choose their topic of innovation from a range of 12 categories such as Electric vehicles, solutions for improving road safety, sensors and actuators for Automotive, renewable energy solutions, etc. You can submit more than one idea and can participate as an individual or with a team. There is no restriction in terms of team configuration your team members can be from the same or different college, department or branches. The second contest called \'i can crack IT\' is the new challenge for this year. Here we, KPIT, provide you with a problem statement spanning across topics such as automotive diagnostics, artificial intelligence and analytics, autonomous driving, infotainment, cybersecurity etc. and expect you to come up with a solution for the same. We will enable you to crack this challenge by providing the required environment, useful links, and access to data available for research! Of course, that\'s only part of the fun. The world and India suffers from thousands of problems in the energy and mobility space. These are crying to be solved. And, who better than the energetic young generation to crack those problems. Who better than you to innovate and work on a solution that may save the world tomorrow! Exciting or outrageous, if your idea is innovative, you get a chance to win. One of the winners of the 2019 challenge was a team of engineering students from Belagavi. Their invention a special Power Chair that charges your phone while you relax on it! Other young minds at KPIT Sparkle have created things like a vertical axis water turbine (VAWT), which is 24% more efficient than a conventional system. Some have designed a scalable plant-based microbial fuel cell technology while others have designed a novel transmission system (single stage gearbox) to increase the load carrying capacity and gradeability of existing e-vehicles. Clearly, the thousands of problems we spoke of earlier present millions of opportunities too! All that glitters the prize money It is not just plaques and certificates at KPIT Sparkle. You can also get excited about awards worth Rs. 21 Lakhs for students and Rs. 60,000 for their mentors for \'i Innovate\'. \'i can crack IT\' presents 20 awards of Rs. 50,000 each. Have we got your complete attention now? And this money is only a part of the whole prize. Resume building Most companies look at the kind of experience you have gathered in your student life during their hiring process. Participating in a contest like KPIT Sparkle adds to your resume value immensely. This platform gives you an opportunity to showcase your skills, innovative mindset, problem-solving capabilities, teamwork and dedication to project completion. And the biggest brand names in the world look for that on your resume when they come to campus. KPIT Sparkle is a coveted contest that sees students participating even from premier institutions such as the IIT\'s, NIT\'s as well as other colleges across India. In this contest, you\'ll be working on real-world problems providing real-world, working solutions. And such opportunities make any resume shine. Interact with top industry minds Our jury consists of stalwarts from the industry. Imagine the opportunity and the kind of learning you get when you interact with great minds like Padma Vibhushan Dr. R. A. Mashelkar who heads our jury panel. Contestants in past events have had the golden opportunity to collect feedback from great minds like Dr. Peter F Tropschuh, Vice President, Strategy Sustainability, AUDI AG, Dr. Carl Perrin, Director, Coventry University, Dr. Milind Rane, Professor, IIT Mumbai, Dr. Pravin Kumar, Professor, IIT Guwahati and Dr. Siddhartha Mukhopadhyay, Professor IIT Kharagpur. They have found that a well-placed word or a subtle nudge has helped them transform their thinking and inspired them to newer heights. Unparalleled opportunities to bring your idea to life We have partnered with DST and AICTE. DST is the knowledge partner for KPIT Sparkle and takes the winning and promising KPIT Sparkle ideas to the next level for the actual application using DST incubation centers through various DST schemes. The AICTE partnership enables active and deeper participation of key institutions and support from their faculty for motivating and guiding students for quality ideas. Along with this, there are internships from KPIT on offer for the promising 3rd year UG / 1st year PG Engineering students. Added to that are joint IP creation and filing opportunities with KPIT. Your innovation at KPIT Sparkle may be the stepping stone to a new product, a new business, or a new world. Recruitment opportunities When we meet so many impressive young minds at KPIT Sparkle, how can we not be tempted to make a deeper commitment to them? Quite obviously, this is a recruitment opportunity to take seriously. Over the last couple of years, several valid idea submissions for KPIT Sparkle have resonated with us so much that we have offered to employ their creators. Some of these people have then driven those ideas to a logical conclusion as KPIT employees! So, what do you think? Wouldn\'t you want to be a part of a competition that opens up a world of opportunities for you?&lt;/span&gt;&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '.ws-1630913832671_3 {border-style:dashed;border-color:#000000;} .ws-row-data-2 { border-style:solid; }', '&lt;div class=&quot;rowData ui-sortable-handle container-fluid ws-row-data-1&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630913797824_6&quot; class=&quot;col-lg-12 ws-1630913797824_6&quot;&gt;&lt;div id=&quot;ws_1630913799359&quot; class=&quot;ws_1630913799359&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Opportunity does not come gift wrapped. You must take risks. But what if we told you that we\'ve got an opportunity on the offering and there are no risks attached? At best, the most risk you\'ll have to take is to get out of your comfort zone and the spectrum of excuses that are keeping you from taking your innovative idea to success. Before you dismiss this as a \'too good to be true\' kind of claim, read on. This opportunity that we are talking about is KPIT Sparkle. Since its inception in 2015, KPIT Sparkle, a one of a kind an innovation contest, has provided science and engineering students from across India, a platform to present innovative ideas related to the field of energy and transportation to solve real-world problems. The competition is open to all students from an undergraduate level to Ph.D. While KPIT sparkle is a competition, it is quite unlike regular contests. There is an award, and a handsome one, but this competition moves beyond awards. So let\'s begin with the scale of the program. In 2015, the first edition, 100 colleges participated in the contest which rose to 1121 in the 5th edition. 22150 students participated in this program in 2019 submitting 2065 ideas. While the competition is getting tougher owing to its rising popularity, here\'s a look at what all you could win.&lt;/span&gt;&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;rowData container ws-row-data-2&quot; data-count=&quot;2&quot; data-type=&quot;row&quot; data-row-type=&quot;container&quot;&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630913832671_3&quot; class=&quot;col-lg-12 ws-1630913832671_3&quot;&gt;&lt;div id=&quot;ws_1630913839008&quot; class=&quot;ws_1630913839008&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot; style=&quot;position: relative; left: 0px; top: 0px;&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Solve real-world problems Let\'s talk about opportunity first. This year along with the \'i Innovate\' contest, we are hosting another contest called \'i can crack IT\'. The \'i Innovate\' contest looks for valid and innovative ideas in the area of \'mobility and energy\'. This year\'s theme for the same is \'Mobility &amp;amp; Energy for the Future\'. The students can choose their topic of innovation from a range of 12 categories such as Electric vehicles, solutions for improving road safety, sensors and actuators for Automotive, renewable energy solutions, etc. You can submit more than one idea and can participate as an individual or with a team. There is no restriction in terms of team configuration your team members can be from the same or different college, department or branches. The second contest called \'i can crack IT\' is the new challenge for this year. Here we, KPIT, provide you with a problem statement spanning across topics such as automotive diagnostics, artificial intelligence and analytics, autonomous driving, infotainment, cybersecurity etc. and expect you to come up with a solution for the same. We will enable you to crack this challenge by providing the required environment, useful links, and access to data available for research! Of course, that\'s only part of the fun. The world and India suffers from thousands of problems in the energy and mobility space. These are crying to be solved. And, who better than the energetic young generation to crack those problems. Who better than you to innovate and work on a solution that may save the world tomorrow! Exciting or outrageous, if your idea is innovative, you get a chance to win. One of the winners of the 2019 challenge was a team of engineering students from Belagavi. Their invention a special Power Chair that charges your phone while you relax on it! Other young minds at KPIT Sparkle have created things like a vertical axis water turbine (VAWT), which is 24% more efficient than a conventional system. Some have designed a scalable plant-based microbial fuel cell technology while others have designed a novel transmission system (single stage gearbox) to increase the load carrying capacity and gradeability of existing e-vehicles. Clearly, the thousands of problems we spoke of earlier present millions of opportunities too! All that glitters the prize money It is not just plaques and certificates at KPIT Sparkle. You can also get excited about awards worth Rs. 21 Lakhs for students and Rs. 60,000 for their mentors for \'i Innovate\'. \'i can crack IT\' presents 20 awards of Rs. 50,000 each. Have we got your complete attention now? And this money is only a part of the whole prize. Resume building Most companies look at the kind of experience you have gathered in your student life during their hiring process. Participating in a contest like KPIT Sparkle adds to your resume value immensely. This platform gives you an opportunity to showcase your skills, innovative mindset, problem-solving capabilities, teamwork and dedication to project completion. And the biggest brand names in the world look for that on your resume when they come to campus. KPIT Sparkle is a coveted contest that sees students participating even from premier institutions such as the IIT\'s, NIT\'s as well as other colleges across India. In this contest, you\'ll be working on real-world problems providing real-world, working solutions. And such opportunities make any resume shine. Interact with top industry minds Our jury consists of stalwarts from the industry. Imagine the opportunity and the kind of learning you get when you interact with great minds like Padma Vibhushan Dr. R. A. Mashelkar who heads our jury panel. Contestants in past events have had the golden opportunity to collect feedback from great minds like Dr. Peter F Tropschuh, Vice President, Strategy Sustainability, AUDI AG, Dr. Carl Perrin, Director, Coventry University, Dr. Milind Rane, Professor, IIT Mumbai, Dr. Pravin Kumar, Professor, IIT Guwahati and Dr. Siddhartha Mukhopadhyay, Professor IIT Kharagpur. They have found that a well-placed word or a subtle nudge has helped them transform their thinking and inspired them to newer heights. Unparalleled opportunities to bring your idea to life We have partnered with DST and AICTE. DST is the knowledge partner for KPIT Sparkle and takes the winning and promising KPIT Sparkle ideas to the next level for the actual application using DST incubation centers through various DST schemes. The AICTE partnership enables active and deeper participation of key institutions and support from their faculty for motivating and guiding students for quality ideas. Along with this, there are internships from KPIT on offer for the promising 3rd year UG / 1st year PG Engineering students. Added to that are joint IP creation and filing opportunities with KPIT. Your innovation at KPIT Sparkle may be the stepping stone to a new product, a new business, or a new world. Recruitment opportunities When we meet so many impressive young minds at KPIT Sparkle, how can we not be tempted to make a deeper commitment to them? Quite obviously, this is a recruitment opportunity to take seriously. Over the last couple of years, several valid idea submissions for KPIT Sparkle have resonated with us so much that we have offered to employ their creators. Some of these people have then driven those ideas to a logical conclusion as KPIT employees! So, what do you think? Wouldn\'t you want to be a part of a competition that opens up a world of opportunities for you?&lt;/span&gt;&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-06-08', 1, '2021-11-17', 1, 'active', 'What_s_new_in_KPIT_Sparkle_this_year_', 'What\'s new in KPIT Sparkle this year?', 'What\'s new in KPIT Sparkle this year?', 'What\'s new in KPIT Sparkle this year?'),
(19, '', '', '', 'blogImage471.jpg', '', '', '', '', '2021-06-08', 1, '2021-06-08', 1, 'delete', '', '', '', '');
