ou that we\'ve got an opportunity on the offering and there are no risks attached? At best, the most risk you\'ll have to take is to get out of your comfort zone and the spectrum of excuses that are keeping you from taking your innovative idea to success. Before you dismiss this as a \'too good to be true\' kind of claim, read on. This opportunity that we are talking about is KPIT Sparkle. Since its inception in 2015, KPIT Sparkle, a one of a kind an innovation contest, has provided science and engineering students from across India, a platform to present innovative ideas related to the field of energy and transportation to solve real-world problems. The competition is open to all students from an undergraduate level to Ph.D. While KPIT sparkle is a competition, it is quite unlike regular contests. There is an award, and a handsome one, but this competition moves beyond awards. So let\'s begin with the scale of the program. In 2015, the first edition, 100 colleges participated in the contest which rose to 1121 in the 5th edition. 22150 students participated in this program in 2019 submitting 2065 ideas. While the competition is getting tougher owing to its rising popularity, here\'s a look at what all you could win.&lt;/p&gt;&lt;p&gt;Solve real-world problems Let\'s talk about opportunity first. This year along with the \'i Innovate\' contest, we are hosting another contest called \'i can crack IT\'. The \'i Innovate\' contest looks for valid and innovative ideas in the area of \'mobility and energy\'. This year\'s theme for the same is \'Mobility &amp;amp; Energy for the Future\'. The students can choose their topic of innovation from a range of 12 categories such as Electric vehicles, solutions for improving road safety, sensors and actuators for Automotive, renewable energy solutions, etc. You can submit more than one idea and can participate as an individual or with a team. There is no restriction in terms of team configuration your team members can be from the same or different college, department or branches. The second contest called \'i can crack IT\' is the new challenge for this year. Here we, KPIT, provide you with a problem statement spanning across topics such as automotive diagnostics, artificial intelligence and analytics, autonomous driving, infotainment, cybersecurity etc. and expect you to come up with a solution for the same. We will enable you to crack this challenge by providing the required environment, useful links, and access to data available for research! Of course, that\'s only part of the fun. The world and India suffers from thousands of problems in the energy and mobility space. These are crying to be solved. And, who better than the energetic young generation to crack those problems. Who better than you to innovate and work on a solution that may save the world tomorrow! Exciting or outrageous, if your idea is innovative, you get a chance to win. One of the winners of the 2019 challenge was a team of engineering students from Belagavi. Their invention a special Power Chair that charges your phone while you relax on it! Other young minds at KPIT Sparkle have created things like a vertical axis water turbine (VAWT), which is 24% more efficient than a conventional system. Some have designed a scalable plant-based microbial fuel cell technology while others have designed a novel transmission system (single stage gearbox) to increase the load carrying capacity and gradeability of existing e-vehicles.&lt;/p&gt;&lt;p&gt;Clearly, the thousands of problems we spoke of earlier present millions of opportunities too! All that glitters the prize money It is not just plaques and certificates at KPIT Sparkle. You can also get excited about awards worth Rs. 21 Lakhs for students and Rs. 60,000 for their mentors for \'i Innovate\'. \'i can crack IT\' presents 20 awards of Rs. 50,000 each. Have we got your complete attention now? And this money is only a part of the whole prize. Resume building Most companies look at the kind of experience you have gathered in your student life during their hiring process. Participating in a contest like KPIT Sparkle adds to your resume value immensely. This platform gives you an opportunity to showcase your skills, innovative mindset, problem-solving capabilities, teamwork and dedication to project completion. And the biggest brand names in the world look for that on your resume when they come to campus. KPIT Sparkle is a coveted contest that sees students participating even from premier institutions such as the IIT\'s, NIT\'s as well as other colleges across India. In this contest, you\'ll be working on real-world problems providing real-world, working solutions. And such opportunities make any resume shine. Interact with top industry minds Our jury consists of stalwarts from the industry. Imagine the opportunity and the kind of learning you get when you interact with great minds like Padma Vibhushan Dr. R. A. Mashelkar who heads our jury panel. Contestants in past events have had the golden opportunity to collect feedback from great minds like Dr. Peter F Tropschuh, Vice President, Strategy Sustainability, AUDI AG, Dr. Carl Perrin, Director, Coventry University, Dr. Milind Rane, Professor, IIT Mumbai, Dr. Pravin Kumar, Professor, IIT Guwahati and Dr. Siddhartha Mukhopadhyay, Professor IIT Kharagpur. They have found that a well-placed word or a subtle nudge has helped them transform their thinking and inspired them to newer heights.&lt;/p&gt;&lt;p&gt;Unparalleled opportunities to bring your idea to life We have partnered with DST and AICTE. DST is the knowledge partner for KPIT Sparkle and takes the winning and promising KPIT Sparkle ideas to the next level for the actual application using DST incubation centers through various DST schemes. The AICTE partnership enables active and deeper participation of key institutions and support from their faculty for motivating and guiding students for quality ideas. Along with this, there are internships from KPIT on offer for the promising 3rd year UG / 1st year PG Engineering students. Added to that are joint IP creation and filing opportunities with KPIT. Your innovation at KPIT Sparkle may be the stepping stone to a new product, a new business, or a new world. Recruitment opportunities When we meet so many impressive young minds at KPIT Sparkle, how can we not be tempted to make a deeper commitment to them? Quite obviously, this is a recruitment opportunity to take seriously. Over the last couple of years, several valid idea submissions for KPIT Sparkle have resonated with us so much that we have offered to employ their creators. Some of these people have then driven those ideas to a logical conclusion as KPIT employees! So, what do you think? Wouldn\'t you want to be a part of a competition that opens up a world of opportunities for you? Are you in it to win it?&amp;nbsp;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;If yes, sign up now at&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;https://sparkle.kpit.com/&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 122, 183); background-color: rgb(255, 255, 255);&quot;&gt;https://sparkle.kpit.com/&lt;/a&gt;&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-03', 1, '2021-11-17', 1, 'active', 'Beyond_Awards_All_that_KPIT_Sparkle_has_to_offer', 'Beyond Awards - All that KPIT Sparkle has to offer', 'Beyond Awards - All that KPIT Sparkle has to offer', 'Beyond Awards - All that KPIT Sparkle has to offer');
INSERT INTO `ab_blogs` (`blogID`, `blogTitle`, `description`, `category`, `blogImage`, `blogTemplate`, `pageCode`, `pageCss`, `pageContent`, `createdDate`, `createdBy`, `ModifiedDate`, `modifiedBy`, `status`, `blogLink`, `blogSubTitle`, `metaKeywords`, `metaDesc`) VALUES
(21, 'A Vision of Smart Transportation for India\'s Smart Cities', 'In only a few years, we may well be able to realize our dreams for a hundred smart cities in India. These cities would be responsible, responsive, and visionary. They would achieve this through reliable and efficient transportation facilitated by mobile apps, big data, sensors, the Internet of Things, and the \"Smart\" applications of technologies and processes.\n\nEnabling connectivity between civic facilities, transportation assets, and devices can allow these changes to take shape. As municipalities leverage information and communication technologies, we can imagine a future not very far away from where we live in cities with extreme connectivity and augmented urban services in terms of transportation, utilities, and energy.\n\nIn fact, intelligent mobility- connected and sustainable multi-modal transport may be at the heart of a smart city.\n\nSmart city transportation challenges and opportunitiesIf public transport is made accessible and robust through shared mobility, citizens will be able to choose it over private transportation options for their commuting needs.\n\nLet\'s explore the challenges and opportunities in smart mobility:Connecting vehicles to their surroundingsWe can use a wide variety of applications, services, and technologies to enable the connection between vehicles and their surroundings.\n\nGet warned about a jam in your path and take another road- it\'s possible when your vehicle is connected with the traffic light that can sense congested areas nearby.\n\nA connected vehicle will include communication devices- embedded or portable- which enable in-car connectivity with other devices in the same vehicle.\n\nThe connected vehicle also needs to be able to interact with other vehicles and \'things\' that are external. The applications of doing so include infotainment, parking assistance, telematics, remote diagnostics, traffic safety, and support, autonomous self-driving vehicles, and more. Possibilities are still emerging -the technology exists. Now it\'s up to those with the imagination to make things happen. Using Electricity to fire up mobilityTesla\'s electric car models are perhaps the most talked about in this regard. According to InsideEVs, Tesla Model 3 was the top-selling plug-in car in Canada for September 2018. In the USA, Tesla is reported to have outsold some iconic luxury car brands in recent time periods. The Tesla model 3 also happens to be the safest car according to the National Highway Traffic Safety Administration.\n\nElectricity-powered cars present a uniquely synergistic opportunity for smart city initiatives as they reduce pollution and open avenues to explore efficient resource utilization for a more responsible generation and a greener future.\n\nSmart Parking FacilitiesParking solutions can help optimize the limited parking spaces in urban localities while providing an efficient way of parking cars. Smart parking solutions can help ensure smoother traffic flow and less congestion.\n\nCompanies around the world are working toward making parking systems sustainable and useful as per city plans. That\'s an idea whose time has come in India too and we need solutions that are specific to our urban centers.\n\nSmart stationsSmart stations are the transit hubs that bring together a wide variety of transportation services to help visitors commute. These can be used as centers for deploying autonomous, connected vehicles- cars, taxis, and urban freight. These can also become centers for urban renewal and community spaces.\n\nDriver and vehicle monitoringThe connectivity of both the vehicle and the driver to the internet opens up a unique opportunity to monitor them in real-time. By doing so, any anomalies in vehicle health can be identified before it does any damage.\n\nMoreover, driver performance and safety can be taken into consideration- allowing for faster reaction in cases of incidents on the road. This can also drive more intelligent and specific services like tailored insurance premium quotes driven by the driving habits of the individual.\n\nWeather analysis and routingAn intelligent transportation system can help you leverage data about the weather forecast and plan your travel efficiently. The vehicle driver can gather information about various routes and the subsequent climate conditions to define an ideal travel route that avoids delay and hassle. As can be imagined, this could prove a boon in our nation of extreme weather conditions.\n\nMobility on demandUsing information present in the data management ecosystem, a smart city can have an app and interactive kiosks that integrate the private and public mobility providers. Then, people can choose the best option for them, based on their needs and get the right vehicle delivered or be routed to it. The future may not be dominated by personal vehicles.\n\nSecurity as a challengeMore research and analysis has to go into ensuring that these provisions of convenience don\'t harm the security of data or citizen privacy in any manner. When we talk about the Internet of Things, we often say there is enough data, but less understanding of it.\n\nThe availability of data simply means there is more of what malicious attackers can use. A major challenge for implementing smart city solutions will be to make sure the security is as stringent as without all that connectivity.\n\nUrban Density as a challengeMulti-modal mobility options attempt to solve the issue of high urban density that often disrupts traffic management. This system offers access to various modes of transport via a single interface such as a mobile app. Mobility-as-a-service can be used to integrate the first and last-mile connectivity seamlessly.\n\nThe increasing penetration of mobile phones, coupled with the proliferation of digital technologies, can help offer innovative transportation solutions to contribute to the adoption of MaaS.\n\nConnected vehicles as the foundation of a smart cityThe latest IDC smart cities spending guide highlights that smart city-based spending will reach $189 billion by 2023. According to the study, the priority areas today include resilient energy, infrastructure projects, data-driven public safety, and intelligent transportation.\n\nThese priority areas will account for over half of the entire global spending for smart cities throughout the 2019-2023 forecast.\n\nIn order to make intelligent mobility viable, feasible, and cost-effective, it\'s clear that the best brains will have to get to work to find out solutions to the most pressing challenges and create prototypes that can be tested in reality.\n\nLet\'s brainstorm the future of Smart mobility as without smart mobility, a Smart City will be but an impossible dream!\n\n(KPIT SParkle\'s sixth edition is an opportunity for you to shape meaningful mobility solutions for the future.\n\nWe invite industry and academia to brainstorm the Mobility & Energy solutions of tomorrow. This platform is for students of undergraduate, post-graduate, and Ph.D. courses from the Science, Engineering, Management, and Design streams across India.)', '6', 'blogImage648.jpg', '', '&lt;div class=&quot;rowData ui-sortable-handle&quot; data-count=&quot;9&quot; data-type=&quot;row&quot; data-row-type=&quot;container-fluid&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&q