way from where we live in cities with extreme connectivity and augmented urban services in terms of transportation, utilities, and energy.&lt;/p&gt;&lt;p&gt;In fact, intelligent mobility- connected and sustainable multi-modal transport may be at the heart of a smart city.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Smart city transportation challenges and opportunities &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;If public transport is made accessible and robust through shared mobility, citizens will be able to choose it over private transportation options for their commuting needs.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Let\'s explore the challenges and opportunities in smart mobility:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Connecting vehicles to their surroundings&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;We can use a wide variety of applications, services, and technologies to enable the connection between vehicles and their surroundings.&lt;/p&gt;&lt;p&gt;Get warned about a jam in your path and take another road- it\'s possible when your vehicle is connected with the traffic light that can sense congested areas nearby.&lt;/p&gt;&lt;p&gt;A connected vehicle will include communication devices- embedded or portable- which enable in-car connectivity with other devices in the same vehicle.&lt;/p&gt;&lt;p&gt;The connected vehicle also needs to be able to interact with other vehicles and \'things\' that are external. The applications of doing so include infotainment, parking assistance, telematics, remote diagnostics, traffic safety, and support, autonomous self-driving vehicles, and more. Possibilities are still emerging -the technology exists. Now it\'s up to those with the imagination to make things happen.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Using Electricity to fire up mobility&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Tesla\'s electric car models are perhaps the most talked about in this regard. According to InsideEVs, Tesla Model 3 was the top-selling plug-in car in Canada for September 2018. In the USA, Tesla is reported to have outsold some iconic luxury car brands in recent time periods. The Tesla model 3 also happens to be the safest car according to the National Highway Traffic Safety Administration.&lt;/p&gt;&lt;p&gt;Electricity-powered cars present a uniquely synergistic opportunity for smart city initiatives as they reduce pollution and open avenues to explore efficient resource utilization for a more responsible generation and a greener future.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Smart Parking Facilities&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Parking solutions can help optimize the limited parking spaces in urban localities while providing an efficient way of parking cars. Smart parking solutions can help ensure smoother traffic flow and less congestion.&lt;/p&gt;&lt;p&gt;Companies around the world are working toward making parking systems sustainable and useful as per city plans. That\'s an idea whose time has come in India too and we need solutions that are specific to our urban centers.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Smart stations&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Smart stations are the transit hubs that bring together a wide variety of transportation services to help visitors commute. These can be used as centers for deploying autonomous, connected vehicles- cars, taxis, and urban freight. These can also become centers for urban renewal and community spaces.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Driver and vehicle monitoring&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;The connectivity of both the vehicle and the driver to the internet opens up a unique opportunity to monitor them in real-time. By doing so, any anomalies in vehicle health can be identified before it does any damage.&lt;/p&gt;&lt;p&gt;Moreover, driver performance and safety can be taken into consideration- allowing for faster reaction in cases of incidents on the road. This can also drive more intelligent and specific services like tailored insurance premium quotes driven by the driving habits of the individual.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Weather analysis and routing&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;An intelligent transportation system can help you leverage data about the weather forecast and plan your travel efficiently. The vehicle driver can gather information about various routes and the subsequent climate conditions to define an ideal travel route that avoids delay and hassle. As can be imagined, this could prove a boon in our nation of extreme weather conditions.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Mobility on demand&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Using information present in the data management ecosystem, a smart city can have an app and interactive kiosks that integrate the private and public mobility providers. Then, people can choose the best option for them, based on their needs and get the right vehicle delivered or be routed to it. The future may not be dominated by personal vehicles.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Security as a challenge&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;More research and analysis has to go into ensuring that these provisions of convenience don\'t harm the security of data or citizen privacy in any manner. When we talk about the Internet of Things, we often say there is enough data, but less understanding of it.&lt;/p&gt;&lt;p&gt;The availability of data simply means there is more of what malicious attackers can use. A major challenge for implementing smart city solutions will be to make sure the security is as stringent as without all that connectivity.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Urban Density as a challenge&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Multi-modal mobility options attempt to solve the issue of high urban density that often disrupts traffic management. This system offers access to various modes of transport via a single interface such as a mobile app. Mobility-as-a-service can be used to integrate the first and last-mile connectivity seamlessly.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The increasing penetration of mobile phones, coupled with the proliferation of digital technologies, can help offer innovative transportation solutions to contribute to the adoption of MaaS.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Connected vehicles as the foundation of a smart city&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;The latest&amp;nbsp;IDC smart cities spending guide&amp;nbsp;highlights that smart city-based spending will reach $189 billion by 2023. According to the study, the priority areas today include resilient energy, infrastructure projects, data-driven public safety, and intelligent transportation.&lt;/p&gt;&lt;p&gt;These priority areas will account for over half of the entire global spending for smart cities throughout the 2019-2023 forecast.&lt;/p&gt;&lt;p&gt;In order to make intelligent mobility viable, feasible, and cost-effective, it\'s clear that the best brains will have to get to work to find out solutions to the most pressing challenges and create prototypes that can be tested in reality.&lt;/p&gt;&lt;p&gt;Let\'s brainstorm the future of&amp;nbsp;&lt;strong&gt;Smart mobility as without smart mobility, a Smart City will be but an impossible dream!&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;(KPIT SParkle\'s sixth edition is an opportunity for you to shape meaningful mobility solutions for the future.&lt;/p&gt;&lt;p&gt;We invite industry and academia to brainstorm the Mobility &amp;amp; Energy solutions of tomorrow. This platform is for students of undergraduate, post-graduate, and Ph.D. courses from the Science, Engineering, Management, and Design streams across India.)&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-04', 1, '2021-11-17', 1, 'active', 'A_Vision_of_Smart_Transportation_for_India_s_Smart_Cities', 'A Vision of Smart Transportation for India\'s Smart Cities', 'A Vision of Smart Transportation for India\'s Smart Citi', 'A Vision of Smart Transportation for India\'s Smart Cities'),
(22, 'Innovative transport solutions for India\'s far flung villages', 'The total rural workforce in India comprises 21 million women and 63 million men. Out of this population, 55% prefer to walk or use a bicycle to reach work, but this decision does not stem from personal choice, it stems from a lack of accessibility to public transport, and not having the means to pay the price for distances beyond 10 km.\n\nEven though one may not realize it, rural India is actually the backbone of the major metropolitans. The Skills Gap Report by the NSDC reported that around 119 million additional skilled workers will be needed by 24 sectors such as logistics, handloom and so on, by 2022. But because the cities of India are already bursting at the seams, a strong public transport system would be the need of the hour, to enable rural workers to travel long and short distances at an accessible rate. Without that, the rural workers would be hamstrung without being able to access the jobs that need them.\n\nOf course, poor transport connectivity also impacts daily life in villages. This restricts the access of the rural population to medical facilities, education, and opportunities.\n\nIn this blog, we will look into some such solutions that have promising potential for connecting India\'s most rural areas.\nKinisi Electric BicyclesKinisi is a unit of the experimental township, Auroville in rural Tamil Nadu. They fall under the Center for Scientific Research. They saw that the muddy trails and lack of roads in the area and the surrounding villages were proving dangerous for two-wheelers to navigate, and so the Kinisi cycle was born. These are electric cycles which use the momentum built by pedaling to generate a push so that one can cover very long distances with minimal effort. They are also designed for the harshest weather conditions and the toughest terrains, making them ideal solutions for villages. They charge fast and are highly efficient as well.\n\nDrones for blood transportationRecently, an unmanned aerial vehicle, a UAV, successfully deployed a single unit of blood from a remote village to a primary health care center in Uttarakhand! The use of drones to transport blood is an innovative and effective way to reach remote and geographically difficult to access areas. The drone was created by an IIT Kanpur alumni and can carry 500 grams of blood in a single flight. It can also fly up to 50 kilometers on one charge! This could be a game changer for villages where access to the right medical facilities or treatment could prove fatal. So many people succumb to injury or lose their lives during childbirth on account of a lack of blood in case of transfusions. Consider how that situation could be remedied with accessible, simple, air transport?\n\nTelangana and the \'electric tuk-tuk\' revolutionTelangana has much of the resources and infrastructure it needs to lead the way for the electric vehicle revolution in India. This is why the startups in the state receive a fair share of the grants and funding from the government. In fact, Telangana based Gayam Motor Works Pvt Ltd are in such popular demand, that their clientele includes the likes of Amazon, Ikea, and Uber! The operational cost of an electric rickshaw is one-seventh that of a petrol rickshaw, which means that they are not just green but are also very lean and cost-efficient. When distributed widely, these electric tuk-tuks can transform the way villagers commute.\n\nEnabling informal carpoolingThe world offers inspiration for our problems too. For eg, rural America runs on Liberty, which is just like Lyft or Uber, but more focused on communities with transportation gaps. It\'s not just about rides, but about providing mobility as a service. Local partners are identified and engaged, and the rates set are very affordable. The strategy has worked so well that they were able to expend to 60 counties across the US.\n\nWhile we may not have the infrastructure to set up fleets of vehicles in Indian villages, what could be set up is an informal carpooling system, one where car owners can connect with people in the area and carpool at a minimal cost. This provides an income for the vehicle owner and also enables people to travel at subsidized costs.\n\nThere\'s no doubt that rural India needs access to mobility, whether it\'s for long work commutes to neighboring cities, to visit relatives in a nearby village, or to drive better access to important facilities. More infrastructure may not be the best answer, because that brings its own set of cost and environmental challenges, so it\'s more about making our current systems more intelligent and cost-efficient.\n\nThe electric bikes for example that have made the sight of farmers zipping around quite a common sight in the region because they have the durability and adaptability of a cycle, with the energy of your average scooty! Even the humble homegrown electric tuk-tuk has massive potential beyond metropolitan cities.\n\nThese solutions are not just cost-efficient but are also green. When the huge population of rural India starts adopting these innovative alternative transport methods, it could be the signal for a transformation that could benefit us all.', '6', '', '', '&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630916297562_57&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630916300849&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;The total rural workforce in India comprises 21 million women and 63 million men. Out of this population, 55% prefer to walk or use a bicycle to reach work, but this decision does not stem from personal choice, it stems from a lack of accessibility to public transport, and not having the means to pay the price for distances beyond 10 km.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Even though one may not realize it, rural India is actually the backbone of the major metropolitans. The Skills Gap Report by the NSDC reported that around 119 million additional skilled workers will be needed by 24 sectors such as logistics, handloom and so on, by 2022. But because the cities of India are already bursting at the seams, a strong public transport system would be the need of the hour, to enable rural workers to travel long and short distances at an accessible rate. Without that, the rural workers would be hamstrung without being able to access the jobs that need them.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;Of course, poor transport connectivity also impacts daily life in villages. This restricts the access of the rural population to medical facilities, education, and opportunities.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(111, 111, 111);&quot;&gt;In this blog, we will look into some such solutions that have promising potential for connecting India\'s most rural areas.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Kinisi Electric Bicycles&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Kinisi is a unit of the experimental township, Auroville in rural Tamil Nadu. They fall under the Center for Scientific Research. They saw that the muddy trails and lack of roads in the area and the surrounding villages were proving dangerous for two-wheelers to navigate, and so the Kinisi cycle was born. These are electric cycles which use the momentum built by pedaling to generate a push so that one can cover very long distances with minimal effort. They are also designed for the harshest weather conditions and the toughest terrains, making them ideal solutions for villages. They charge fast and are highly efficient as well.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Drones for blood transportation&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Recently, an unmanned aerial vehicle, a UAV, successfully deployed a single unit of blood from a remote village to a primary health care center in Uttarakhand! The use of drones to transport blood is an innovative and effective way to reach remote and geographically difficult to access areas. The drone was created by an IIT Kanpur alumni and can carry 500 grams of blood in a single flight. It can also fly up to 50 kilometers on one charge! This could be a game changer for villages where access to the right medical facilities or treatment could prove fatal. So many people succumb to injury or lose their lives during childbirth on account of a lack of blood in case of transfusions. Consider how that situation could be remedied with accessible, simple, air transport?&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Telangana and the \'electric tuk-tuk\' revolution&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Telangana has much of the resources and infrastructure it needs to lead the way for the electric vehicle revolution in India. This is why the startups in the state receive a fair share of the grants and funding from the government. In fact, Telangana based Gayam Motor Works Pvt Ltd are in such popular demand, that their clientele includes the likes of Amazon, Ikea, and Uber! The operational cost of an electric rickshaw is one-seventh that of a petrol rickshaw, which means that they are not just green but are also very lean and cost-efficient. When distributed widely, these electric tuk-tuks can transform the way villagers commute.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Enabling informal carpooling&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;The world offers inspiration for our problems too. For eg, rural America runs on Liberty, which is just like Lyft or Uber, but more focused on communities with transportation gaps. It\'s not just about rides, but about providing mobility as a service. Local partners are identified and engaged, and the rates set are very affordable. The strategy has worked so well that they were able to expend to 60 counties across the US.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;While we may not have the infrastructure to set up fleets of vehicles in Indian villages, what could be set up is an informal carpooling system, one where car owners can connect with people in the area and carpool at a minimal cost. This provides an income for the vehicle owner and also enables people to travel at subsidized costs.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;There\'s no doubt that rural India needs access to mobility, whether it\'s for long work commutes to neighboring cities, to visit relatives in a nearby village, or to drive better access to important facilities. More infrastructure may not be the best answer, because that brings its own set of cost and environmental challenges, so it\'s more about making our current systems more intelligent and cost-efficient.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The electric bikes for example that have made the sight of farmers zipping around quite a common sight in the region because they have the durability and adaptability of a cycle, with the energy of your average scooty! Even the humble homegrown electric tuk-tuk has massive potential beyond metropolitan cities.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;These solutions are not just cost-efficient but are also green. When the huge population of rural India starts adopting these innovative alternative transport methods, it could be the signal for a transformation that could benefit us all.&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i cl