(23, 'Are you up for a challenge? Here is where we need your help', 'We don\'t grow when things are easy we grow when we face challenges\n\nAt KPIT Sparkle, over the past 6 years, we have been a witness to the brightest minds of the country showcasing their potential and innovation at an inspirational level.These students come up with out-of-the-box ideas and solutions, and we\'re happy to do our bit in facilitating these new ways of doing things. Over this time, undergraduate, post-graduate, and Ph.D. students from Science, Engineering, Design or Management colleges in India have grabbed the platform to bring their ideas to life.\n\nBut what\'s success without a little bit of challenge? This year, we\'re looking to challenge students, professors, and faculty through an exciting contest where they can showcase their imagination, skills, and initiative in the areas of Mobility and Energy.', '6', 'blogImage276.jpg', '', '&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630920908107_6&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630920911771&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;We don\'t grow when things are easy we grow when we face challenges&lt;/p&gt;&lt;p&gt;At KPIT Sparkle, over the past 6 years, we have been a witness to the brightest minds of the country showcasing their potential and innovation at an inspirational level.&lt;/p&gt;&lt;p&gt;These students come up with out-of-the-box ideas and solutions, and we\'re happy to do our bit in facilitating these new ways of doing things. Over this time, undergraduate, post-graduate, and Ph.D. students from Science, Engineering, Design or Management colleges in India have grabbed the platform to bring their ideas to life.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;But what\'s success without a little bit of challenge? This year, we\'re looking to challenge students, professors, and faculty through an exciting contest where they can showcase their imagination, skills, and initiative in the areas of Mobility and Energy.&lt;/p&gt;&lt;p&gt;What is the contest?&lt;/p&gt;&lt;p&gt;A KPIT Sparkle first this year, the \'i can crack IT\' innovation contest gives participants an opportunity to solve real-world problems. They can choose from a range of problem statements across various categories within Mobility and Energy and try to come up with the best solution. Since all the required links, data, and informational resources are provided by KPIT, all the participants have to do is to rack their brains and come up with out-of-the-box solutions that are modern and innovative. Students can add one faculty as a team member, and also file for a shared patent with KPIT for the solution they provide.&lt;/p&gt;&lt;p&gt;Mind you, these are not easy or run-of-the-mill problems. These are problems that our in-house experts have already grappled with and found challenging. Challenging enough, in fact, for them to have to turn to you, bright young minds with a request for help.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;How does it work?&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;The \'i can crack IT\' contest is for all students of undergraduate, post-graduate, and Ph.D. courses from Science, Engineering, Design and Management colleges and universities across India. Students can participate either as an individual (=1 member) or as a team (=3 members including a Professor). The good news is, there is no restriction on team configuration team members can be from the same or different department(s), branches, and colleges.&lt;/p&gt;&lt;p&gt;Once a student registers for \'i can crack IT\', he/she can opt for a category of their choice and pick from a list of problem statements. Once a statement has been selected, all the details of the problem are provided, along with important deliverables and milestones.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;What is the theme?&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;As fossil fuels start losing their sheen, renewable sources of energy pick up steam, and the trend of automation becomes a mainstay, there is a lot happening in the energy sector across the world. Transportation and Mobility is being similarly transformed.&lt;/p&gt;&lt;p&gt;To keep pace with the myriad changes happening in the sector, KPIT Sparkle focusses on the theme of Mobility and Energy for the future. If you have an inclination towards modernizing these sectors, there are a number of problem statements you can choose from, and submit your solution to win exciting prizes:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;1- Automotive cybersecurity&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Device authentication mechanism over LIN&lt;/li&gt;&lt;li&gt;Fuzz testing on LIN-based implementations&lt;/li&gt;&lt;li&gt;Identification and validation of vulnerabilities using penetration testing&lt;/li&gt;&lt;li&gt;Security assessment of secure flashing and bootloader&lt;/li&gt;&lt;li&gt;Security assessment of autonomous vehicles&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;2- Connected Vehicles&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Biker to biker communication&lt;/li&gt;&lt;li&gt;Optimum routing for on-demand delivery&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;3- Infotainment&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Automotive Init&lt;/li&gt;&lt;li&gt;Qt Quick Optimization&lt;/li&gt;&lt;li&gt;App Armor SMACK SE Linux Evaluation for KIVI&lt;/li&gt;&lt;li&gt;Calendar Integration Using Konnect&lt;/li&gt;&lt;li&gt;HCI Snoop Log&lt;/li&gt;&lt;li&gt;Intelligent Testing System&lt;/li&gt;&lt;li&gt;KD Bus Migration&lt;/li&gt;&lt;li&gt;MFI Trace Parser Tool&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;4- Autonomous driving&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Design and develop efficient multiple object tracking algorithm&lt;/li&gt;&lt;li&gt;Automatic number plate recognition (ANPR) for different fonts and non-roman scripts&lt;/li&gt;&lt;li&gt;Gaze, micro-gestures and hand-signal detection of law-enforcement officers and other road-users&lt;/li&gt;&lt;li&gt;Detection of kerb-side parking-slot with poor kerb-side/lane-markings&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;5- Electric Vehicle&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Motor efficiency&lt;/li&gt;&lt;li&gt;State of health&lt;/li&gt;&lt;li&gt;Optimization of battery thermal management&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;6- Powertrain&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Fusion of physics and machine learning&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;7- Alternative powertrain&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Solid state battery&lt;/li&gt;&lt;li&gt;Hydrogen storage&lt;/li&gt;&lt;li&gt;Hydrogen purification&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;8- Automotive diagnostics&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;9- Tools&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Expense recognition software challenge&lt;/li&gt;&lt;li&gt;Test automation tools&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;10- Analytics&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;EV schedule generation and optimization&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;How you can participate&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Participating in \'i can crack IT\' is extremely easy all you have to do is, log on to https://sparkle.kpit.com, register by filling in all relevant information and select the problem statement you want to address. Once you receive the problem statement document, you need to carefully go through it to understand the deliverables and milestones that you will have to commit to. You are then expected to submit the expected output mentioned in Milestone 1. All the submitted ideas and solutions will then be evaluated for Milestone 2. Those teams that complete the second milestone will then compete for the awards.&lt;/p&gt;&lt;p&gt;Pull up your socks&lt;/p&gt;&lt;p&gt;As the world progresses at lightning fast speed, the younger generation (i.e. you!) is looking for opportunities to challenge itself and emerge as a winner. And that\'s the opportunity that KPIT Sparkle\'s \'i can crack IT\' offers.&lt;/p&gt;&lt;p&gt;By bringing aboard students from different branches and colleges across India, the innovation platform has been set. All that remains now is to get solutions to some of the most complex problems of tomorrow. And that\'s where you come in.&lt;/p&gt;&lt;p&gt;So, if taking up challenges is your forte, \'i can crack IT\' is your gateway to success. Not only can you choose a problem from your area of interest, but you can also enjoy joint IP opportunities with KPIT, get some much-needed industry exposure, and win awards of INR 50k each.&lt;/p&gt;&lt;p&gt;AS they say, don\'t limit your challenges challenge your limits!&lt;/p&gt;&lt;p&gt;For more information, drop in an email at KPITSparkle2020@kpit.com&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData container-fluid ws-row-data-2&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630920908107_6&quot; class=&quot;col-lg-12 ws-1630920908107_6&quot;&gt;&lt;div id=&quot;ws