t;&lt;strong&gt;10- Analytics&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;EV schedule generation and optimization&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;How you can participate&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Participating in \'i can crack IT\' is extremely easy all you have to do is, log on to https://sparkle.kpit.com, register by filling in all relevant information and select the problem statement you want to address. Once you receive the problem statement document, you need to carefully go through it to understand the deliverables and milestones that you will have to commit to. You are then expected to submit the expected output mentioned in Milestone 1. All the submitted ideas and solutions will then be evaluated for Milestone 2. Those teams that complete the second milestone will then compete for the awards.&lt;/p&gt;&lt;p&gt;Pull up your socks&lt;/p&gt;&lt;p&gt;As the world progresses at lightning fast speed, the younger generation (i.e. you!) is looking for opportunities to challenge itself and emerge as a winner. And that\'s the opportunity that KPIT Sparkle\'s \'i can crack IT\' offers.&lt;/p&gt;&lt;p&gt;By bringing aboard students from different branches and colleges across India, the innovation platform has been set. All that remains now is to get solutions to some of the most complex problems of tomorrow. And that\'s where you come in.&lt;/p&gt;&lt;p&gt;So, if taking up challenges is your forte, \'i can crack IT\' is your gateway to success. Not only can you choose a problem from your area of interest, but you can also enjoy joint IP opportunities with KPIT, get some much-needed industry exposure, and win awards of INR 50k each.&lt;/p&gt;&lt;p&gt;AS they say, don\'t limit your challenges challenge your limits!&lt;/p&gt;&lt;p&gt;For more information, drop in an email at KPITSparkle2020@kpit.com&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-06', 1, '2021-11-17', 1, 'active', 'Are_you_up_for_a_challenge_Here_is_where_we_need_your_help', 'Are you up for a challenge? Here is where we need your help', 'challenge', 'We don\'t grow when things are easy we grow when we face challenges  At KPIT Sparkle, over the past 6 years, we have been a witness to the brightest minds of the country showcasing their potential and innovation at an inspirational level.'),
(24, 'What India Must Do To Lead The World In Solar Power?', 'Here\'s some good news. India is emerging as one of the leaders for fighting climate change. This is driven by several innovative solutions. And it\'s despite (or because of?) the initiative to supply the people with electricity 24x7 by 2030.\n\nIn fact, there was a clear lead for the country in some estimates. The hope now is that India could easily achieve the target of 40% of its non-fossil based power capacity by 2020. Based on that, the Indian government has also increased its goal of renewable energy capacity to 227 GW from 175 GW.', '6', '', '', '&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot; style=&quot;&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630921947718_51&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630921949677&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;Here\'s some good news. India is emerging as one of the leaders for fighting climate change. This is driven by several innovative solutions. And it\'s despite (or because of) the initiative to&amp;nbsp;supply the people with electricity 24x7 by 2030.&lt;/p&gt;&lt;p&gt;In fact, there was a clear lead for the country in some estimates. The hope now is that India could easily achieve the target of&amp;nbsp;40% of its non-fossil based power capacity by 2020.&amp;nbsp;Based on that, the Indian government has also increased its goal of renewable energy capacity to 227 GW from 175 GW.&lt;/p&gt;&lt;p&gt;However, emerging economies like India have to strike a balance between energy generation, deployment while battling other constraints such as development and availability of funds. Here are some challenges faced by India in the task to become a world leader in solar power:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Lack of a Better Solar Power Supply Chain&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;At present, the solar power supply chain in the country is short of the mark. It needs to be improved to be seamless, transparent, robust and wide-spread if India needs to achieve its target of securing more GW of renewable energy.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Shortage of Investment&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;There is a shortage of investment to build new solar projects. Bloomberg projects a shortfall of $2.5 trillion of investment in solar through 2040. This is when compared to the level of investment that is needed to meaningfully climate change.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Solar Cell Imports and Exports&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;India imported 89% of its total solar cells from China in 2017-18. At current economies, the solar industry is finding Chinese imports more cost-effective as compares to the costs of manufacturing here. However, this dependence on the neighboring country is creating its own roadblocks.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Dipping Solar Power Tariff&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;The next big problem is the dipping solar power tariff, which today stands at an average of Rs. 2.44 per unit. Even as tariffs drop, the set-up costs and equipment costs are not decreasing. Solar power producers worry about low ROI and a long time to recover costs.&lt;/p&gt;&lt;p&gt;The good news is that the Indian government is cognizant of many of these issues. Some possible solutions they are looking at to these issues include:&lt;/p&gt;&lt;p&gt;Government of India imposed 25% safeguard duty on Chinese solar cells till July 2019. The same duty is slated to decrease to 20% till January 2020, and then, dip to 15% in July 2020. This can to an extent curb the overdependence on China for solar cells. While this will impact costs in the short term, it could drive up manufacturing in India. As economies of scale set in, the overall cost could also reduce.&lt;/p&gt;&lt;p&gt;The government may take the initiative to lower the costs of solar panel setups and the costs of the equipment. This will give more incentives to individuals and organizations to adopt and switch to solar power.&lt;/p&gt;&lt;p&gt;As a part of its focus, the Government of India is implementing transparent bidding. This will help procure solar power based on a tariff-based competitive bidding process. And under the KUSUM (Kisan Urja Suraksha evam Utthaan Mahabhiyan) Scheme, it has planned to offer 27.5 lakh solar pumps to farmers. This could help them install 10 GW of Solar Power Plants, which will have the capacity of 0.5 to 2MW each.&lt;/p&gt;&lt;p&gt;There is also a wealth of ideas and innovation emerging to inspire change in the sector.&lt;/p&gt;&lt;p&gt;&lt;u&gt;The World Bank&lt;/u&gt;&amp;nbsp;is giving India\'s solar energy dream a push by providing over $1 billion for its solar plans. This includes a Grid Connected Rooftop Solar project, which is for putting solar panels on the rooftops across the country. With the help of this project, 100 MW of energy has already been financed.&lt;/p&gt;&lt;p&gt;Inventive solutions such as&amp;nbsp;&lt;u&gt;Bio-Solar cells&lt;/u&gt;&amp;nbsp;are an interesting take in making solar power commonplace and affordable. While research is still, only underway, in this direction, the invention can become a potential resource for supplying long-term power.&lt;/p&gt;&lt;p&gt;Floating Solar Farms made from floating solar panels are another incredible idea that can propel India to adopt solar power on a wide scale. It has already been implemented in nations where there is a lack of space for installing ground-mounted solar systems and soon enough, we could see it&amp;nbsp;&lt;u&gt;happen in India&lt;/u&gt;. This could reduce the equipment and setup costs to a large extent and works perfectly for industries that are looking forward to not waste either water or land.&lt;/p&gt;&lt;p&gt;Switching to Perovskite solar cells is another innovation that could pave the way for India to become a leading solar power nation. Known for its excellent light absorption and versatile nature, these cells can help realize solar energy deployment on just about any surface. And that\'s not all. These cells could cost&amp;nbsp;&lt;em&gt;&lt;u&gt;just 10 to 20 cents per watt, compared to 75 cents per watt for traditional silicon-based panels anywhere from 3X to 8X cost savings&lt;/u&gt;&lt;/em&gt;.&lt;/p&gt;&lt;p&gt;India may be in the early days when it comes to solar power. But it wants to shoot for global leadership. While many of the innovations and research in solar power are happening in other countries, India is keen to amplify its efforts to leapfrog the world and become the solar leader.&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData container-fluid ws-row-data-2&quot; data-count=&quot;2&quot; data-type=&quot;row&quot; style=&quot;&quot;&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630921947718_51&quot; class=&quot;col-lg-12 ws-1630921947718_51&quot;&gt;&lt;div id=&quot;ws_1630921949677&quot; class=&quot;ws_1630921949677&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;Here\'s some good news. India is emerging as one of the leaders for fighting climate change. This is dri