h today stands at an average of Rs. 2.44 per unit. Even as tariffs drop, the set-up costs and equipment costs are not decreasing. Solar power producers worry about low ROI and a long time to recover costs.&lt;/p&gt;&lt;p&gt;The good news is that the Indian government is cognizant of many of these issues. Some possible solutions they are looking at to these issues include:&lt;/p&gt;&lt;p&gt;Government of India imposed 25% safeguard duty on Chinese solar cells till July 2019. The same duty is slated to decrease to 20% till January 2020, and then, dip to 15% in July 2020. This can to an extent curb the overdependence on China for solar cells. While this will impact costs in the short term, it could drive up manufacturing in India. As economies of scale set in, the overall cost could also reduce.&lt;/p&gt;&lt;p&gt;The government may take the initiative to lower the costs of solar panel setups and the costs of the equipment. This will give more incentives to individuals and organizations to adopt and switch to solar power.&lt;/p&gt;&lt;p&gt;As a part of its focus, the Government of India is implementing transparent bidding. This will help procure solar power based on a tariff-based competitive bidding process. And under the KUSUM (Kisan Urja Suraksha evam Utthaan Mahabhiyan) Scheme, it has planned to offer 27.5 lakh solar pumps to farmers. This could help them install 10 GW of Solar Power Plants, which will have the capacity of 0.5 to 2MW each.&lt;/p&gt;&lt;p&gt;There is also a wealth of ideas and innovation emerging to inspire change in the sector.&lt;/p&gt;&lt;p&gt;&lt;u&gt;The World Bank&lt;/u&gt;&amp;nbsp;is giving India\'s solar energy dream a push by providing over $1 billion for its solar plans. This includes a Grid Connected Rooftop Solar project, which is for putting solar panels on the rooftops across the country. With the help of this project, 100 MW of energy has already been financed.&lt;/p&gt;&lt;p&gt;Inventive solutions such as&amp;nbsp;&lt;u&gt;Bio-Solar cells&lt;/u&gt;&amp;nbsp;are an interesting take in making solar power commonplace and affordable. While research is still, only underway, in this direction, the invention can become a potential resource for supplying long-term power.&lt;/p&gt;&lt;p&gt;Floating Solar Farms made from floating solar panels are another incredible idea that can propel India to adopt solar power on a wide scale. It has already been implemented in nations where there is a lack of space for installing ground-mounted solar systems and soon enough, we could see it&amp;nbsp;&lt;u&gt;happen in India&lt;/u&gt;. This could reduce the equipment and setup costs to a large extent and works perfectly for industries that are looking forward to not waste either water or land.&lt;/p&gt;&lt;p&gt;Switching to Perovskite solar cells is another innovation that could pave the way for India to become a leading solar power nation. Known for its excellent light absorption and versatile nature, these cells can help realize solar energy deployment on just about any surface. And that\'s not all. These cells could cost&amp;nbsp;&lt;em&gt;&lt;u&gt;just 10 to 20 cents per watt, compared to 75 cents per watt for traditional silicon-based panels anywhere from 3X to 8X cost savings&lt;/u&gt;&lt;/em&gt;.&lt;/p&gt;&lt;p&gt;India may be in the early days when it comes to solar power. But it wants to shoot for global leadership. While many of the innovations and research in solar power are happening in other countries, India is keen to amplify its efforts to leapfrog the world and become the solar leader.&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-06', 1, '2021-11-17', 1, 'active', 'What_India_Must_Do_To_Lead_The_World_In_Solar_Power_', 'What India Must Do To Lead The World In Solar Power?', 'India  Solar Power', 'What India Must Do To Lead The World In Solar Power?   Here\'s some good news. India is emerging as one of the leaders for fighting climate change. This is driven by several