INSERT INTO `ab_blogs` (`blogID`, `blogTitle`, `description`, `category`, `blogImage`, `blogTemplate`, `pageCode`, `pageCss`, `pageContent`, `createdDate`, `createdBy`, `ModifiedDate`, `modifiedBy`, `status`, `blogLink`, `blogSubTitle`, `metaKeywords`, `metaDesc`) VALUES
(25, 'How India\'s Clean Energy Sector is Shining and Leading the World', 'India is now among the world\'s fastest-growing economies. The good news is that the growing economic development of the country is in-sync with its efforts in becoming a world leader in the clean energy sector as well.\n\nFor instance, India plans to achieve 175 GW of renewable energy capacity by 2022 as a part of its climate commitments. Out of this, 100 GW is to come from its solar projects. These projects will include about 60 GW from the ground-mounted and grid-connected projects as well as 40 GW from the solar rooftop projects. The wind power projects are going to deliver 60 GW. For now, the country has installed capacity of about 80 GW. Moreover, the country has a goal to set up 500 gigawatts (GW) of renewable energy capacity by 2030. This has the potential to put the country in pole position among the nations of the world.', '6', '', '', '&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630922391287_4&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630922394365&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;India is now among the world\'s fastest-growing economies. The good news is that the growing economic development of the country is in-sync with its efforts in becoming a world leader in the clean energy sector as well.&lt;/p&gt;&lt;p&gt;For instance, India plans to achieve 175 GW of renewable energy capacity by 2022 as a part of its climate commitments. Out of this, 100 GW is to come from its solar projects. These projects will include about 60 GW from the ground-mounted and grid-connected projects as well as 40 GW from the solar rooftop projects. The wind power projects are going to deliver 60 GW. For now, the country has installed capacity of about 80 GW. Moreover, the country has a goal to set up 500 gigawatts (GW) of&amp;nbsp;renewable energy&amp;nbsp;capacity by 2030. This has the potential to put the country in pole position among the nations of the world.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;How is India Progressing on the Clean Energy Map?&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;With a sustained and planned increase in the investments in the sector and a growing number of clean energy installations, India is just behind Chile in the&amp;nbsp;2018 Climatescope&amp;nbsp;report. Also, it ranked 4th on E and Y\'s Renewable Energy Country Attractiveness Index in the past year. Additionally, it became the single largest market for distributed standalone solar projects in the first half of 2018. It should be noted that these accounted for about 33% of global sales.&lt;/p&gt;&lt;p&gt;The nation also witnessed a record low solar tariffs of â‚¹2.44 per unit while the wind power tariff dropped to a record low of â‚¹2.64 per unit.&lt;/p&gt;&lt;p&gt;India becoming a key player of clean energy can be due to the promise of rural India, which offers tremendous opportunities in clean energy. Farmers, in particular, represent a&amp;nbsp;$50 billion opportunity&amp;nbsp;in clean energy. Of this, $40 billion is offered by agriculture. The non-rural sector, on the other hand, presents opportunities that are worth more than $13 billion.&lt;/p&gt;&lt;p&gt;These opportunities are driven by some rapid changes that are taking place, including companies taking interest and investing in the sector and support systems emerging.&lt;/p&gt;&lt;p&gt;Among the&amp;nbsp;&lt;u&gt;Government Initiatives&lt;/u&gt;&amp;nbsp;for boosting clean energy is the National Solar Thermal Power testing, research and simulation facility. It includes a grid-connected Solar Thermal Power Plant of 1MW capacity. Moreover, the initiative will include a test set up for the interested firms and institutions, who want to test the performance of various solar materials, concentrators, components, and systems for a Solar Thermal Power Plant.&lt;/p&gt;&lt;p&gt;SoftBank\'s SB Energy is investing in India\'s renewable energy portfolio, with more than 3,000 Mw of renewable capacity. The CEO of the firm also went ahead and promised free power from its solar plants in India to the ISA member countries post the completion of the asset\'s initial 25-year Power Purchase Agreement (PPA) period. The firm also invested $250 million in Ola Electric, an electric mobility service company. Singapore-based Sembcorp plans to invest in its Indian subsidiary, SEIL (Sembcorp Energy India Limited). As of June 2019, the firm owns 1,700 Mw of capacity in India, including 550 Mw under development. But no country can steer ahead in any sector without innovation. Here are some inspirational innovations that represent the nationwide commitment that is propelling India\'s clean energy sector towards massive growth:&lt;/p&gt;&lt;p&gt;Atomberg Technologies created an energy-efficient ceiling fan. Based on BLDC (Brushless Direct Current) motor technology, it consumes about 65% less electrical energy as compared to conventional motor technologies. It is all about the reduction of energy usage without any compromise on air delivery.&lt;/p&gt;&lt;p&gt;Avant Garde is a Kerala-based cleantech startup, which claims to be the country\'s first and only startup that has a 100% renewable energy commitment. The firm aims to innovate and introduce affordable and sustainable solutions in renewable energy via a decentralized and distributed approach. The firm is creating wind turbine generators, which will be cost-effective but without compromising on the performance aspect.&lt;/p&gt;&lt;p&gt;Basil Energetics has come up with a renewable energy solution, which includes a smart micro-grid. This grid offers a completely decentralized energy solution that can be used in both rural and urban areas. Furthermore, it also provides a solution to manage green power as a package including solar panels and innovative hybrid household electrical appliances. The entire demand and supply of electricity is managed by the smart grid, which ultimately leads to the use of more solar power for running hybrid equipment. This makes the conversion from DC to AC redundant, and at the same time, makes the system energy efficient. India Go Solar is an eCommerce marketplace in India, which offers a platform to customers for purchasing various solar products. This includes solar rooftop kit, solar backpacks, solar mobile chargers, and other services and projects. This is a great initiative to make clean energy easily accessible in various households.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;The Road Ahead&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;A robust support system along with thriving innovations and emerging solutions for energy storage is the key to scale up clean energy innovation deployment if India wants to remain at the top in the clean energy sector. This will not only pave the way for new technologies but keep yielding continuous returns from potential investors. In the long run, clean energy innovations will play a major role in offering reliable energy to rural as well as urban India. The sector is booming and the opportunities are many!&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData container-fluid ws-row-data-2&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630922391287_4&quot; class=&quot;col-lg-12 ws-1630922391287_4&quot;&gt;&lt;div id=&quot;ws_1630922394365&quot; class=&quot;ws_1630922394365&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;India is now among the world\'s fastest-growing economies. The good news is that the growing economic development of the country is in-sync with its efforts in becoming a world leader in the clean energy sector as well.&lt;/p&gt;&lt;p&gt;For instance, India plans to achieve 175 GW of renewable energy capacity by 2022 as a part of its climate commitments. Out of this, 100 GW is to come from its solar projects. These projects will include about 60 GW from the ground-mounted and grid-connected projects as well as 40 GW from the solar rooftop projects. The wind power projects are going to deliver 60 GW. For now, the country has installed capacity of about 80 GW. Moreover, the country has a goal to set up 500 gigawatts (GW) of&amp;nbsp;renewable energy&amp;nbsp;capacity by 2030. This has the potential to put the country in pole position among the nations of the world.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;How is India Progressing on the Clean Energy Map?&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;With a sustained and planned increase in the investments in the sector and a growing number of clean energy installations, India is just behind Chile in the&amp;nbsp;2018 Climatescope&amp;nbsp;report. Also, it ranked 4th on E and Y\'s Renewable Energy Country Attractiveness Index in the past year. Additionally, it became the single largest market for distributed standalone solar projects in the first half of 2018. It should be noted that these accounted for about 33% of global sales.&lt;/p&gt;&lt;p&gt;The nation also witnessed a record low solar tariffs of â‚¹2.44 per unit while the wind power tariff dropped to a record low of â‚¹2.64 per unit.&lt;/p&gt;&lt;p&gt;India becoming a key player of clean energy can be due to the promise of rural India, which offers tremendous opportunities in clean energy. Farmers, in particular, represent a&amp;nbsp;$50 billion opportunity&amp;nbsp;in clean energy. Of this, $40 billion is offered by agriculture. The non-rural sector, on the other hand, presents opportunities that are worth more than $13 billion.&lt;/p&gt;&lt;p&gt;These opportunities are driven by some rapid changes that are taking place, including companies taking interest and investing in the sector and support systems emerging.&lt;/p&gt;&lt;p&gt;Among the&amp;nbsp;&lt;u&gt;Government Initiatives&lt;/u&gt;&amp;nbsp;for boosting clean energy is the National Solar Thermal Power testing, research and simulation facility. It includes a grid-connected Solar Thermal Power Plant of 1MW capacity. Moreover, the initiative will include a test set up for the interested firms and institutions, who want to test the performance of various solar materials, concentrators, components, and systems for a Solar Thermal Power Plant.&lt;/p&gt;&lt;p&gt;SoftBank\'s SB Energy is investing in India\'s renewable energy portfolio, with more than 3,000 Mw of renewable capacity. The CEO of the firm also went ahead and promised free power from its solar plants in India to the ISA member countries post the completion of the asset\'s initial 25-year Power Purchase Agreement (PPA) period. The firm also invested $250 million in Ola Electric, an electric mobility service company. Singapore-based Sembcorp plans to invest in its Indian subsidiary, SEIL (Sembcorp Energy India Limited). As of June 2019, the firm owns 1,700 Mw of capacity in India, including 550 Mw under development. But no country can steer ahead in any sector without innovation. Here are some inspirational innovations that represent the nationwide commitment that is propelling India\'s clean energy sector towards massive growth:&lt;/p&gt;&lt;p&gt;Atomberg Technologies created an energy-efficient ceiling fan. Based on BLDC (Brushless Direct Current) motor technology, it consumes about 65% less electrical energy as compared to conventional motor technologies. It is all about the reduction of energy usage without any compromise on air delivery.&lt;/p&gt;&lt;p&gt;Avant Garde is a Kerala-based cleantech startup, which claims to be the country\'s first and only startup that has a 100% renewable energy commitment. The firm aims to innovate and introduce affordable and sustainable solutions in renewable energy via a decentralized and distributed approach. The firm is creating wind turbine generators, which will be cost-effective but without compromising on the performance aspect.&lt;/p&gt;&lt;p&gt;Basil Energetics has come up with a renewable energy solution, which includes a smart micro-grid. This grid offers a completely decentralized energy solution that can be used in both rural and urban areas. Furthermore, it also provides a solution to manage green power as a package including solar panels and innovative hybrid household electrical appliances. The entire demand and supply of electricity is managed by the smart grid, which ultimately leads to the use of more solar power for running hybrid equipment. This makes the conversion from DC to AC redundant, and at the same time, makes the system energy efficient. India Go Solar is an eCommerce marketplace in India, which offers a platform to customers for purchasing various solar products. This includes solar rooftop kit, solar backpacks, solar mobile chargers, and other services and projects. This is a great initiative to make clean energy easily accessible in various households.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;The Road Ahead&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;A robust support system along with thriving innovations and emerging solutions for energy storage is the key to scale up clean energy innovation deployment if India wants to remain at the top in the clean energy sector. This will not only pave the way for new technologies but keep yielding continuous returns from potential investors. In the long run, clean energy innovations will play a major role in offering reliable energy to rural as well as urban India. The sector is booming and the opportunities are many!&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-06', 1, '2021-11-17', 1, 'active', 'How_India_s_Clean_Energy_Sector_is_Shining_and_Leading_the_World', 'How India\'s Clean Energy Sector is Shining and Leading the World', 'India\'s Clean Energy', 'How India\'s Clean Energy Sector is Shining and Leading the World'),
(26, '6 options to replace fossil fuels in our cars', 'The greatest threat to our planet is the belief that someone else will save it~ Robert Swan\n\nThat fossil fuels play a dominant role in the world today is known to all. Having been a fundamental driver of the Industrial Revolution, and a major contributor of most of the technological, social, economic, and development progress that followed, fossil fuels have brought about a global change in many ways. But with a growing list of environmental impacts such as air pollution and emittance of carbon dioxide and other greenhouse gases, the time has come to switch to more renewable sources.\nYet, in 2018, fossil fuels provided 80% of the total energy used in the USA, the world\'s leading economy. As greenhouse gas emissions continue to rise, the world is running out of time to avert devastating impacts.', '6', '', '', '&lt;div class=&quot;rowData ui-sortable-handle&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630923162609_43&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630923165134&quot; class=&quot;paragraph-text ws-data-element ui-state-default ui-sortable-handle&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot; style=&quot;position: relative; left: 0px; top: 0px;&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;h4&gt;&lt;strong&gt;6 options to replace fossil fuels in our cars&lt;/strong&gt;&lt;/h4&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;rowData&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div class=&quot;rowHeaders&quot;&gt;&lt;ul class=&quot;act-headers&quot;&gt;&lt;li class=&quot;col-type move-row&quot;&gt;&lt;span class=&quot;material-icons&quot;&gt;open_with&lt;/span&gt;&lt;/li&gt;&lt;li class=&quot;col-type column-selected&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-1&quot; class=&quot;col-type moreoption col-type-1&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-2&quot; class=&quot;col-type moreoption col-type-2&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-3&quot; class=&quot;col-type moreoption col-type-3&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-4&quot; class=&quot;col-type moreoption col-type-4&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-5&quot; class=&quot;col-type moreoption col-type-5&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-6&quot; class=&quot;col-type moreoption col-type-6&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-7&quot; class=&quot;col-type moreoption col-type-7&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-8&quot; class=&quot;col-type moreoption col-type-8&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-9&quot; class=&quot;col-type moreoption col-type-9&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-10&quot; class=&quot;col-type moreoption col-type-10&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-11&quot; class=&quot;col-type moreoption col-type-11&quot;&gt;&lt;/li&gt;&lt;li data-column=&quot;col-12&quot; class=&quot;col-type moreoption col-type-12&quot;&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div class=&quot;row-action-header&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;row-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;span data-action=&quot;delete&quot; class=&quot;row-action material-icons&quot;&gt;close&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;ws-element-wrapper ws-dropable-items&quot;&gt;&lt;div id=&quot;ws-1630923163813_7&quot; class=&quot;ws-row-col ws-col-size-12 block ui-droppable ui-sortable&quot;&gt;&lt;div class=&quot;ws-col-header ui-sortable-handle&quot;&gt;&lt;span data-action=&quot;edit&quot; class=&quot;col-action material-icons&quot;&gt;edit&lt;/span&gt;&lt;/div&gt;&lt;div id=&quot;ws_1630923166781&quot; class=&quot;paragraph-text ws-data-element ui-state-default&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;The greatest threat to our planet is the belief that someone else will save it~ Robert Swan&lt;/p&gt;&lt;p&gt;That fossil fuels play a dominant role in the world today is known to all. Having been a fundamental driver of the Industrial Revolution, and a major contributor of most of the technological, social, economic, and development progress that followed, fossil fuels have brought about a global change in many ways. But with a growing list of environmental impacts such as air pollution and emittance of carbon dioxide and other greenhouse gases, the time has come to switch to more renewable sources.&lt;/p&gt;&lt;p&gt;Yet, in 2018, fossil fuels provided 80% of the total energy used in the USA, the world\'s leading economy. As greenhouse gas emissions continue to rise, the world is running out of time to avert devastating impacts.&lt;/p&gt;&lt;p&gt;The longer we wait to curb fossil fuel usage, the greater the damage they will cause to the environment.&lt;/p&gt;&lt;p&gt;With car sales touching the 78.7 million mark in 2019, it\'s about time to reduce our reliance on fossil fuels, transition towards renewable sources, and balance the role of energy in social and economic development.&lt;/p&gt;&lt;p&gt;Here are 6 options to replace fossil fuels in our cars:&lt;/p&gt;&lt;p&gt;&lt;strong&gt;1. Electricity&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Although electric vehicles have been around for a while, Tesla has made the electric car concept undeniably trendy. Not only are they reliable, cheap, and safe to operate, with modern looks and features, they are also more fun to drive. Since they use high-powered batteries to store electric energy that powers the motor, they minimize the carbon footprint drastically. According to a report by the USA\'s Department of Energy, electric vehicles displaced 323 million gallons of gasoline in the US alone. All they need is a plug-in station, and you\'re good to go.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;2. Hydrogen&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;With emissions virtually nil, hydrogen is another great alternative to fossil fuels. Since power is generated within a fuel cell, they emit only water vapor. An energy efficient vehicle that runs on hydrogen offers fuel efficiency twice as much as a vehicle that runs on fossil fuel. They can convert up to 75% of fuel into usable energy, and drive distances of up to 500 kilometers on a single tank. Since most hydrogen vehicles are equipped by regenerative brakes, they create a better environmental profile, while offering the same driving experience.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;3. Propane&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Propane, or liquefied petroleum gas, is another clean-burning and high-energy alternative to fossil fuels. Although propane vehicles are typically more expensive, the fuel itself is far cheaper than petrol. Also, since the fuel is in a gaseous form, the engine runs far more efficiently, especially in cold weather. The vehicle\'s power, acceleration, and cruising speed are similar to those of conventionally fueled vehicles. Plus, the ease of maintenance and reduced emissions have spurred the use of propane across transport vehicles from small cars to heavy-duty trucks.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;4. Ethanol&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Made from corn or sugarcane, ethanol or ethyl alcohol is a renewable source of energy that is picking up steam (pardon the pun) in the global fuel supply scene. Since ethanol contains less energy compared to fossil fuels, more of it is needed to get the same results. Yet the production and use of ethanol is known to demand greenhouse gas emissions anywhere between 52 to 86% less. Despite the energy needed in producing ethanol being substantially large, the total amount of energy that goes into the process is comparable to the energy released by burning the resulting ethanol fuel, resulting in an energy balance.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;5. Natural gas&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Natural gas finds great application in the industrial sector, mainly for heating buildings and generating electricity. Now it is also becoming a viable fuel for cars. Not only it is abundantly available, but it also has very low carbon monoxide and nitrogen oxide emissions. Today, many hybrid compressed natural gas vehicles are available that are highly fuel-efficient. They offer mileage similar to fossil fuels while burning more cleanly. It is estimated that in India alone could have 10 million CNG vehicles on the roads by 2025.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Do your bit&lt;/strong&gt;&amp;nbsp;Although fossil fuels have long powered the transportation industry, environmental concerns and government regulations are driving car manufacturers as well as consumers to actively seek substitutes for the conventional fossil fuel-powered engine. Electricity, hydrogen, propane, ethanol and natural gas are some extremely efficient greenhouse-friendly alternatives. With fossil fuel levels dropping, and their environmental risks increasing, it\'s time we switch to more greenhouse friendly alternatives and do our bit for the environment.&lt;/p&gt;&lt;p&gt;~It is our collective and individual responsibility to preserve and tend to the world in which we all live~ Dalai Lama&lt;/p&gt;&lt;/span&gt;&lt;span class=&quot;elm-action&quot;&gt;&lt;a class=&quot;wc_control-btn-move&quot; href=&quot;#&quot; title=&quot;Move Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;open_with&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-edit&quot; href=&quot;#&quot; title=&quot;Edit Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;edit&lt;/i&gt;&lt;/a&gt;&lt;a class=&quot;wc_control-btn-del&quot; href=&quot;#&quot; title=&quot;Remove Block&quot;&gt;&lt;i class=&quot;material-icons&quot;&gt;close&lt;/i&gt;&lt;/a&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '&lt;div class=&quot;rowData ui-sortable-handle container-fluid ws-row-data-1&quot; data-count=&quot;1&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-1&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630923162609_43&quot; class=&quot;col-lg-12 ws-1630923162609_43&quot;&gt;&lt;div id=&quot;ws_1630923165134&quot; class=&quot;ws_1630923165134&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot; style=&quot;position: relative; left: 0px; top: 0px;&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;h4&gt;&lt;strong&gt;6 options to replace fossil fuels in our cars&lt;/strong&gt;&lt;/h4&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;rowData container-fluid ws-row-data-2&quot; data-count=&quot;2&quot; data-type=&quot;row&quot;&gt;&lt;div id=&quot;ws-row-data-2&quot; class=&quot;row&quot;&gt;&lt;div id=&quot;ws-1630923163813_7&quot; class=&quot;col-lg-12 ws-1630923163813_7&quot;&gt;&lt;div id=&quot;ws_1630923166781&quot; class=&quot;ws_1630923166781&quot; data-act=&quot;no-drag&quot; data-type=&quot;paragraph&quot;&gt;&lt;span class=&quot;p-txt&quot;&gt;&lt;p&gt;The greatest threat to our planet is the belief that someone else will save it~ Robert Swan&lt;/p&gt;&lt;p&gt;That fossil fuels play a dominant role in the world today is known to all. Having been a fundamental driver of the Industrial Revolution, and a major contributor of most of the technological, social, economic, and development progress that followed, fossil fuels have brought about a g