ile burning more cleanly. It is estimated that in India alone could have 10 million CNG vehicles on the roads by 2025.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Do your bit&lt;/strong&gt;&amp;nbsp;Although fossil fuels have long powered the transportation industry, environmental concerns and government regulations are driving car manufacturers as well as consumers to actively seek substitutes for the conventional fossil fuel-powered engine. Electricity, hydrogen, propane, ethanol and natural gas are some extremely efficient greenhouse-friendly alternatives. With fossil fuel levels dropping, and their environmental risks increasing, it\'s time we switch to more greenhouse friendly alternatives and do our bit for the environment.&lt;/p&gt;&lt;p&gt;~It is our collective and individual responsibility to preserve and tend to the world in which we all live~ Dalai Lama&lt;/p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '2021-09-06', 1, '2021-09-06', 1, 'active', '6_options_to_replace_fossil_fuels_in_our_cars', '6 options to replace fossil fuels in our cars', 'fossil fuels', 'The greatest threat to our planet is the belief that someone else will save it~ Robert Swan  That fossil fuels play a dominant role in the world today is known to all. Having been a fundamental driver of the Industrial Revolution, and a major contributor of most of the technological, social, economic, and development progress that followed, fossil fuels have brought about a global change in many ways. But with a growing list of environmental impacts such as air pollution and emittance of carbon dioxide and other greenhouse gases, the time has come to switch to more renewable sources.');
