(1, 'temp_6971', 'FAQAnswerTemp', 'Answer Subject', '<p>{{question}} {{answer}} {{askedByName}}</p>', '{{question}} {{answer}} {{askedByName}}', 1, '2021-07-08', 1, '2021-07-26', 'delete'),
(2, 'temp_1850', 'forgotPasswordOTPSendTemp', 'Reset Your Password', '<p>Hello {{userName}},</p>\n\n<p>We have recevied request to reset password&nbsp;for the KPIT Sparkle account associated with {{email}}. No Changes have been made to your account yet, you can use below OTP to reset your account password.&nbsp;{{otp}}</p>', 'reset Password', 1, '2021-07-20', 1, '2021-11-22', 'active'),
(3, 'temp_6943', 'forgotPasswordLinkForUserTemp', 'Request for reset password', '<p>Hello {{userName}},</p>\n\n<p>We have recevied request to reset password&nbsp;for KPIT Sparkle account associated with {{email}}. No Changes have been made to your account yet, you can use below OTP to reset your account password.&nbsp;{{resetPasswordLink}}</p>', 'user', 1, '2021-07-21', 1, '2021-07-26', 'delete'),
(4, '', 'ideaSatusChanged', 'Your Idea is {{status}},', '<p>Hello {{userName}},</p>\n\n<p>Your Idea is {{status}}.</p>\n{{reason}}\n', '', 1, '2021-10-05', 1, '2021-10-05', 'active'),
(5, '', 'approveProject', 'Project Approved', '<p>Hello {{userName}},</p>\n\n<p>We have recevied request to reset password&nbsp;for KPIT Sparkle account associated with {{email}}. No Changes heve been made to your account yet, you can use bellow OTP to reset your account password.&nbsp;</p>\n\n', '', 0, '0000-00-00', 0, '0000-00-00', 'active'),
(6, '', 'registration', 'Registration for KPIT Sparkle completed successfully.', '<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Dear {{username}},&nbsp;</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">You have successfully completed your registration for KPIT Shodh. Your Email ID and Mobile Number have been verified successfully. &nbsp;</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">We are happy to have you on this unique learning journey, We will be uploading exciting learning material of KPIT Sparkle on&nbsp;<a href=\"kpit.webtrixsolutions.com\" style=\"color:#1155cc\" target=\"_blank\">KPITSparkle2021@kpit.com</a>&nbsp;website. &nbsp;</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Stay tuned and keep an eye on your registered email / Whatsapp for further updates.&nbsp;</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Let&rsquo;s together grow, explore, discover and strive to reach greater heights in the mobility space.&nbsp; </span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Feel free to contact us on&nbsp;<a href=\"mailto:KPITNova@kpit.com\" style=\"color:#1155cc\" target=\"_blank\">KPITSparkle@kpit.com</a>&nbsp;for any queries. </span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Regards,&nbsp;</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:start\"><span style=\"color:#fff\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Team KPIT Sparkle&nbsp;</span></span></p>', '', 0, '0000-00-00', 0, '0000-00-00', 'active'),
(7, '', 'EmailVerification', 'Email Verification for KPIT Sparkle', '<p>Dear {{userName}},</p>\n\n<p>{{otp}} is your One Time Password to register for KPIT Sparkle. Do not share the OTP with anyone.</p>\n\n', '', 0, '0000-00-00', 0, '0000-00-00', 'active'),
(8, '', 'evaluatorNDA', 'You have accepted the NON Disclosure Agreement for KPIT Sparkle', '<p>Dear {{username}},</p>\n\n<p>Please find below the agreement copy digitally accepted by you. NON-Disclosure Agreement This agreement (&quot;Agreement&quot;), is made and executed on this 15th day of November 2021 (&quot;Effective Date&quot;) by and between the members of the evaluation team for KPIT Sparkle 2022 (Hereinafter referred to as &quot;Party No.1&quot;).</p>\n\n<p>And</p>\n\n<p>KPIT Technologies Ltd., a company with its office at Plot No 17, SEZ, Rajiv Gandhi InfoTech Park, Phase 3, MIDC, Hinjawadi, Pune 411057 (hereinafter referred to as &ldquo;KPIT&rdquo;/ &ldquo;Party No. 2&rdquo; which expression shall, unless repugnant to the context or meaning thereof, be deemed to mean and include its subsidiaries, affiliates, successors and assigns)</p>\n\n<p>Party No. 1, Party No. 2 shall be individually referred to as a &ldquo;Party&rdquo; and collectively as the &ldquo;Parties&rdquo;.</p>\n\n<p>WHEREAS the Parties are exploring a proposal regarding possible collaboration as being on the evaluation network of KPIT Sparkle (&ldquo;Purpose&rdquo;); and</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;WHEREAS, in relation to such Purpose, each Party is willing to disclose to and receive from, the other Party information regarding the identity, plans, business models, products, services, clients, financial data, etc. of Projects submitted by students participating in KPIT&rsquo;s Innovation contest called KPIT Sparkle (in case of Party No. 2). This information is passed on via login ids made for the evaluation team who can login to the portal and look at the information provided by participants, which information the Disclosing Party (defined hereinafter) deem proprietary and/or confidential;</p>\n\n<p>NOW, THEREFORE, in consideration of the mutual covenants and conditions herein contained, the Parties hereto agree as follows:</p>\n\n<p>Confidential Information: For the purpose of this Agreement, the term &ldquo;Confidential Information&rdquo; shall mean and include drawings, formulae, products, services, projects, processes, inventions, technology, know-how, metrics, tools, specifications, photographs, documents, samples, models, machines, software/firmware, machine-readable media of any kind and other information submitted hereunder, including business information, in written, oral, visual or any other form, which is received by one Party (&ldquo;Receiving Party&rdquo;) from the other Party (&ldquo;Disclosing Party&rdquo;) and which is marked proprietary, confidential, or the equivalent, or which the Disclosing Party indicates in writing at the time of disclosure to be considered proprietary, confidential or the equivalent. Information that is disclosed only orally or visually shall not be considered&nbsp;confidential Information unless such oral and visual information is confirmed in writing by the Disclosing Party as being proprietary or confidential within thirty (30) calendar days after such oral or visual disclosure. For 30 days from disclosure, oral or visual information will be provided the same protection as provided to Confidential Information under this Agreement. Confidential Information shall, without prejudice to the meaning assigned to it elsewhere in this Agreement, inter-alia include notes, extracts, analysis or materials prepared by the Receiving Party which are copies of or derivative works of the Confidential Information, or from which the substance of the Confidential Information can be inferred or otherwise understood. &quot;Affiliates&quot; shall mean and include companies in which either Party directly or indirectly holds an interest of more than 50% or more than 50% of the voting shares (&quot;subsidiaries&quot;) and those companies which directly or indirectly hold the afore-mentioned controlling interests (&quot;parent companies&quot;), and their subsidiaries. Affiliates are not deemed to be third parties, provided that they are subject to similar obligations of confidentiality in respect of the information provided.</p>\n\n<p>The Do&rsquo;s and Don&rsquo;ts: The Evaluation team members will adhere to the annexure as mentioned below.</p>\n\n<p>Exclusions of Confidential Information: Information shall not be deemed Confidential Information, and the Receiving Party shall have no obligation with respect to any such information, if such information</p>\n\n<p>(i) is already known to the Receiving Party without any obligation of confidentiality; is or hereafter becomes publicly known through no wrongful act, fault or negligence of the Receiving Party;</p>\n\n<p>(ii) is received by the Receiving Party without restriction or obligation of confidentiality from a third party entitled to so disclose it;</p>\n\n<p>(iii) is independently developed by the Receiving Party who had no direct or indirect access to, or knowledge of, such Confidential Information; or</p>\n\n<p>(iv) is required to be disclosed under any order of a Court, Government body or any other statutory authority; provided the Receiving Party shall make reasonable efforts to give to the Disclosing Party a written notice of such disclosure and shall cooperate with the Disclosing Party in obtaining any injunction order, if so chosen by the Disclosing Party.</p>\n\n<p>Confidentiality Obligations: The Receiving Party shall use the Confidential Information received hereunder solely for evaluation purposes or for any purpose relating to the Purpose or as may be agreed between the Parties. Without limiting the generality of the foregoing,</p>\n\n<p>(a) the Receiving Party shall not make any copies, in whole or in part, in machine readable form or otherwise, of the Confidential Information except for copies to be distributed to its employees, directors, consultants and/or agents who have a need to know the Confidential Information, and in case of computer programs, copies for back-up and archival purposes.</p>\n\n<p>(b) the Receiving Party shall not divulge, disclose, communicate, reproduce, distribute, transmit, reverse engineer, de-compile, disassemble, or transfer, directly or indirectly, in any form either orally or in writing or by any other means to any third party, use or exploit for any purpose, other than for the limited purpose for which it is disclosed, any part of the Confidential Information, except with the prior written consent of the Disclosing Party. The Receiving Party shall be responsible for compliance with the terms of this Agreement by such employees, directors, consultants and/or agents.</p>\n\n<p>The Receiving Party shall use at least the same degree of care in safeguarding the Confidential Information as it uses for its own proprietary or confidential information of like importance and such degree of care shall be at least that which is reasonably calculated to prevent any inadvertent disclosure. The Receiving Party shall limit access to such Confidential Information to those of its employees, directors, representative, agents, consultants, sub-contractors or contractors who are directly or indirectly involved in the consideration of the Purpose or other purpose for which the Confidential Information is disclosed and who are obligated to the Receiving Party by written agreement to not disclose the Confidential Information. Upon discovery of any disclosure or suspected disclosure of any part of the Confidential Information, the Receiving Party shall promptly inform the Disclosing Party of such disclosure or suspected disclosure and shall co-operate with the Disclosing Party in taking all reasonable steps to either prevent the disclosure or limiting the loss or damage arising from such disclosure. This obligation of the Receiving Party to inform the Disclosing Party of any disclosure or suspected disclosure shall be without prejudice to any right of the Disclosing Party against such disclosure or suspected disclosure.</p>\n\n<p>All Confidential Information shall remain the property of the Disclosing Party or its licensors and the Receiving Party shall not acquire any rights therein except the rights expressly provided herein. Upon written request by the Disclosing Party, the Receiving Party shall promptly return to the Disclosing Party all tangible forms of the Confidential Information, within a period of (15) fifteen days or a later date as otherwise indicated by the Disclosing Party and shall destroy all intangible copies and an officer of the Receiving Party shall provide the Disclosing Party with a written certification as to such destruction.</p>\n\n<p>Nothing contained in this Agreement shall be construed as:</p>\n\n<p>(i) requiring the Disclosing Party to disclose to the Receiving Party any particular information;</p>\n\n<p>(ii) any commitment by a Party to enter into any further transaction either in relation to the Purpose or otherwise;</p>\n\n<p>(iii) creating warranties of any kind in connection with any particular information other than those specifically provided herein;</p>\n\n<p>(iv) constituting or implying any representation or commitment as to the development or availability of commercial products, features or services; or</p>\n\n<p>(v) soliciting any business or organization changes or incurring any obligations of any kind not specified herein.</p>\n\n<p>As Is Disclosure-The Disclosing Party warrants it has the right to disclose the Confidential Information provided to the Receiving Party. Except for the foregoing, no other warranties are made whether express or implied, and all Confidential Information is provided &ldquo;as is.&rdquo;</p>\n\n<p>Nothing in this Agreement will be construed as a representation or inference that the Receiving Party will not develop products or services, or have products or services developed for it, that, without violation of this Agreement, compete with the products or services contemplated by or based on the Confidential Information.</p>\n\n<p>Term: This Agreement shall be valid and effective for a period of 3 years from the date of execution hereof. Obligations of the Parties for maintaining confidentiality under this Agreement shall remain valid for a period of seven (7) calendar years from the date of expiry of the Agreement.</p>\n\n<p>Law: This Agreement shall be interpreted and the rights of the Parties determined under the laws of India.</p>\n\n<p>Other Remedies: The Parties acknowledge that damages will be difficult to ascertain in the event of breach of this Agreement, and agree that an injunction may be obtained by the Disclosing Party to protect its rights hereunder, without limiting other rights and remedies the Disclosing Party may have.</p>\n\n<p>Publicity: Neither Party will make any</p>\n\n<p>(i) press release and/or</p>\n\n<p>(ii) public announcement regarding the existence or provisions of this Agreement to a third party without the prior written approval of the other Party.</p>\n\n<p>This Agreement supersedes any prior oral or written understandings and constitutes the entire agreement between the Parties with respect to the matters provided for herein, and no modification, amendment or waiver thereof shall be effective unless in writing and signed by both Parties.</p>\n\n<p>Each party executing this Agreement warrants and represents that he or she has the authority to enter into this Agreement.</p>\n\n<p>If any provision of this Agreement shall be held invalid or unenforceable, the remainder of this Agreement shall nevertheless remain in full force and effect.</p>\n\n<p>This Agreement is executed in duplicate and each copy is treated as original for all legal purposes.</p>\n\n<p>Honorarium Clause:<br />\nEvaluator evaluating ideas would be rewarded with an honorarium of INR 6500 along with Evaluation certificate.</p>\n\n<p>ANNEXURE</p>\n\n<p>Do&#39;s</p>\n\n<p>KPIT expects evaluators to be providing constructive feedback to the participants via the portal chat mechanism.<br />\nWrite a comment in the &lsquo;Evaluator-KPIT&rsquo; section to justify why an idea has been accepted, rejected or put on hold as actions on the evaluator login. This can be conveyed by using the chat mechanism with KPIT team provided in the login.<br />\nThe evaluators will delete any downloaded file or attachments from their respective computers after the evaluation exercise is over.<br />\nStudy the idea thoroughly, research for existing ideas and plagiarism and only then take an action.<br />\nEncourage students to keep innovating, improvising their idea.<br />\nIf an idea is patentable, inform the student to do so on priority.<br />\nDon&#39;ts</p>\n\n<p>Reveal your identity to the students.<br />\nReveal the result of evaluation of an idea to the student through chat mechanism or in any other way.<br />\nDiscourage the student if the idea is not innovative or good enough.<br />\nDigitally Accepted by:&nbsp;{{username}}</p>\n\n<p>Thanks and Regards,<br />\nTEAM KPIT Sparkle 2022</p>\n\n<p>*This is an auto generated email. kindly do not reply</p>', 'kpit sparkle', 0, '0000-00-00', 1, '2022-02-09', 'active'),
(9, 'msgNotification', 'msgNotification', 'New Message', '<p>Hello {{userName}},</p>\r\n\r\n<p>You have received message.</p>', '', 0, '0000-00-00', 0, '0000-00-00', 'active');
INSERT INTO `ab_faqMaster` (`faqID`, `faqQuestion`, `faqAnswer`, `askedByName`, `askedByEmail`, `isPublish`, `isEmailSend`, `createdBy`, `createdDate`, `modifiedBy`, `modifiedDate`, `status`) VALUES
(28, 'Who can submit an idea?', '<p>Individual/Team Leader can submit an idea.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(29, 'How can a team submit an idea?', '<p>The team leader can submit the idea and add his team members to the idea after all of them register individually.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(30, 'Can a team member edit the idea?', '<p>Only the team leader can edit the idea. All other team members can only view the idea and its status.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(31, 'What is KPIT Sparkle 2019 about?', '<p>KPIT Sparkle 2019 is an innovation platform for all students of undergraduate, post-graduate and Ph.D courses from Science, Engineering, Design and Management faculties of colleges and universities across PAN India.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(32, 'Who can register? How do we register?', '<p>https://sparkle-dev.kpit.com/sparkle2019<br />\nPLEASE NOTE:<br />\nIndividual / Team has to enter the project details after the registration. In case of a Team the entrant must invite the other members of his/her Team. The team should consist of 5 members including Team leader. Each Team must appoint a Team leader, (i) who will represent the team, (ii) will be the contact person and (iii) must act as coordinator between the other team members. After registration member will receive an OTP on registered mobile no. and email address for verification.</p>\n\n<p>Who: This innovation platform for all students of undergraduate, post-graduate and Ph.D courses from Science, Engineering, Design and Management faculties of colleges and universities across PAN India.</p>\n\n<p>How: Visit this link for registration:&nbsp;<a href=\"https://sparkle-dev.kpit.com/sparkle2019/registration/signup\">https://sparkle-dev.kpit.com/sparkle2019</a><br />\n&nbsp;</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(33, 'Why do I need to verify my mobile no. and email address?', '<p>We require that you verify your mobile no. and email address to create a KPIT Sparkle account. This will help us to verify that the email address doesn&#39;t belong to someone else. Please note that this is a two-step process. You need to first register and confirm your registration based on a valid e-mail-ID and a Mobile number. After verification of your e-mail-ID and Mobile number by entering the one time password (OTP) pin, you can login.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(34, 'What is expected from the participants?', '<p>A fundamentally innovative idea is the core focus of our competition. The idea must be realized in both: Idea submission over an online form (Phase 1) and a prototype (Phase 2).</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(35, 'What should the team size and the team configuration be?', '<p>You can participate either as an individual (=1 member) or as a team (maximum team size: 5 members). There is no restriction on team configuration; team members can be from same or different department(s), branches and colleges.<br />\nTo configure a Team, entrant has to submit the project and invite the team members to register.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(36, 'What will happen in Idea Submission?', '<p>In Idea submission you can submit your idea over an online [https://sparkle-dev.kpit.com/sparkle2019] website.<br />\nPLEASE NOTE:<br />\nThe milestones of this journey will be decided by&nbsp;<strong>you</strong>&nbsp;depending on the&nbsp;<strong>maturity of your idea.</strong><br />\nWe have categorized innovators into three categories according to maturity of ideas.</p>\n\n<ol>\n	<li>Innovators/ teams having a working prototype<br />\n	<strong>The first phase:</strong>&nbsp;Teams with a working prototype can submit a 3 minute video of the prototype along with the idea form. The advantage of this category is to receive an initial feedback on improvements you can do make the quality of the prototype better.<br />\n	<strong>The second phase:</strong>&nbsp;Selection of the innovative idea, in this phase the teams will be provided the feedback if their ideas are innovative, they will also be allowed for a revision in the prototype if selected as innovative<br />\n	<strong>The third phase:</strong>&nbsp;is for the final selection to Finale.</li>\n	<li>Innovators/ Teams having an Idea but no prototype as of now<br />\n	<strong>The first phase:</strong>&nbsp;Teams having an idea can submit the idea by using the idea submission form. We are looking out for answers for important questions on when a prototype would be ready.<br />\n	<strong>The second phase:</strong>&nbsp;Selection of the innovative idea, in this phase the teams will be provided the feedback if their ideas are innovative, they will be provided go ahead for prototyping.<br />\n	<strong>The third phase:</strong>&nbsp;the team has to submit a video for the working prototype and will be selected for the finale by a set of evaluators.</li>\n	<li>Innovators/ Teams not having any idea as of now<br />\n	These teams can register their details with KPIT Sparkle as of now but are advised to hurry up as all successful idea selections for finale have to cross the above mentioned hurdles.</li>\n</ol>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(37, 'According to which criteria\'s will my idea be judged?', '<p>Your idea will be judged on the following criteria, in order of importance:</p>\n\n<p>Innovation<br />\nSocial Impact<br />\nTechnical knowledge<br />\nCompleteness of prototype</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(38, 'How will the submitted Ideas be selected for Prototyping?', '<p>The organizer, assisted by KPIT&#39;s R&amp;D experts, along with independent external experts, will evaluate, filter, and select the best ideas according to above mentioned criteria, which will be nominated for prototyping phase and further selected for finale.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(39, 'How will I know if my idea is accepted?', '<p>KPIT will send an e-mail to your registered email ID and an SMS to your registered mobile no. which mentions your idea being selected to next phase. (Note: This mail can end up in your spam box, be sure to check it, if needed). You will also be able to see the status when you login to the &ldquo;My Ideas&rdquo; page.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(40, 'How do I proceed if my idea is selected?', '<p>Once your idea/solution gets shortlisted, you can start working towards creating a prototype of your idea for further evaluation. The KPIT Sparkle team will send you an email/SMS confirmation for prototyping/ revision of existing prototypes.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(41, 'What will happen in Prototyping phase?', '<p>In prototyping phase, participants needs to prepare a high quality prototype to show how their idea could be executed in reality and submit short description and video (~ 3 minutes) to show the working of their prototype. They can revise the videos till the last date mentioned in terms and conditions.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(42, 'What is a prototype?', '<p>The prototype is a working implementation of the idea submitted involves hardware and/ or software.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(43, 'What is accepted as a prototype?', '<p><span style=\"color:#ffffff\">The actual idea should be realized in the prototype which can be implemented on any of the following:</span></p>\n\n<ul>\n	<li><span style=\"color:#ffffff\">Hardware</span></li>\n	<li><span style=\"color:#ffffff\">Software</span></li>\n	<li><span style=\"color:#ffffff\">Car</span></li>\n	<li><span style=\"color:#ffffff\">Bike</span></li>\n	<li><span style=\"color:#ffffff\">Bicycle</span></li>\n</ul>\n\n<p><span style=\"color:#ffffff\">NOTE: Small scale models or toy mechanisms will not be accepted as prototype!</span></p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(44, 'How will I know that I\'m invited to the final event?', '<p>KPIT will send you an e-mail to your registered email ID and an SMS to your registered mobile no. with further information regarding the final presentation. The format of the presentation will also be sent across.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(45, 'What does the Grand Finale mean?', '<p>During the grand finale independent jury consisting of reputable experts will assess the best ideas and give ratings based on defined parameters according to the award criteria. All potential awardees will be invited to this ceremony held in Pune as a 2 day event. During the finale you will have the unique opportunity to make yourself known to KPIT and the members of our jury. The best innovations will also be rewarded after the finale with cash prizes or attractive benefits.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(46, 'Where can I Submit my project?', '<p>In the &ldquo;My Ideas&rdquo; page [Post login], the idea submission form will be made available.<br />\nIn case of Team the entrant has to submit the project to invite team members to form a Team.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(47, 'I don\'t have time to finish my project, Is it possible to send it after the deadline?', '<p>All projects must be submitted on&nbsp;<strong>Time</strong></p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(48, 'How can Design and Management students participate in the contest?', '<p>If you have an innovative idea that aligns with the theme, you can submit it directly. If not, we can give you a chance to collaborate with already submitted projects where you will have to create a prototype design or a case study for the idea.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(49, 'Can the same team submit several ideas?', '<p>Yes, participants can submit as many ideas as they wish.</p>', '', '', 0, 0, 1, '2021-09-07', 1, '2021-09-09', 'active'),
(50, 'Guidelines to submit your simulation file', '<h4><strong>You have to submit a document of simulation of your idea along with an explanation of what you are trying to prove&nbsp;<a href=\"https://sparkle.kpit.com/assets/simulation_guidelines.pdf\" target=\"_blank\">Read More</a></strong></h4>', '', '', 0, 0, 1, '2021-09-09', 1, '2021-09-09', 'delete'),
(51, 'Guidelines to submit an idea', '<p><strong>You can submit an idea only under the &#39;Mobility and Energy&#39; Theme</strong></p>\n\n<p><br />\n<strong>Steps to follow:</strong></p>\n\n<p>1. On your Dashboard, click on &#39;Submit Idea&#39;</p>\n\n<p>2. Select Category, Sub Category</p>\n\n<p>3. Enter the title of your project and a brief description of your idea</p>\n\n<p>4. After that we ask you a few multiple choice questions. Select the appropriate options</p>\n\n<p>5. Read the guidance tips for each question to proceed further</p>\n\n<p>6. Also enter the problem statement and your unique solution</p>\n\n<p>7. Submit the photo of your prototype (current stage)</p>', '', '', 0, 0, 1, '2021-09-09', 0, '0000-00-00', 'active'),
(52, 'Guidelines to add team members', '<p><strong>MAX TEAM SIZE:</strong>&nbsp;5</p>\n\n<p><strong>NOTE:</strong>&nbsp;Only Team Leader can submit a project and add team members to it.</p>\n\n<p><br />\n<strong>Steps to follow:</strong></p>\n\n<p>1. Ask all your team members to register individually.</p>\n\n<p>2. All team members have to verify their email id and mobile no through OTP.</p>\n\n<p>3. Once registration of all team members is successful, you can invite them.</p>\n\n<p>4. On your dashboard, Click on the title of the idea. It will display your idea and an option to invite team members.</p>\n\n<p>5. Enter the correct registered mobile numbers of your team members(Max 4).</p>\n\n<p>6. Your team will be added/built successfully.</p>', '', '', 0, 0, 1, '2021-09-09', 0, '0000-00-00', 'active'),
(53, 'Guidelines to submit your simulation file', '<p><strong>You have to submit a document of simulation of your idea along with an explanation of what you are trying to prove&nbsp;&nbsp;<a href=\"https://sparkle.kpit.com/assets/simulation_guidelines.pdf\" target=\"_blank\">Read Document</a></strong></p>', '', '', 0, 0, 1, '2021-09-09', 0, '0000-00-00', 'active');
