INSERT INTO `ab_project_master` (`projectID`, `userID`, `sparkleID`, `projectName`, `categoryID`, `subCategoryID`, `projectDiscription`, `technicalDescription`, `keywords`, `patentFiled`, `patentStatus`, `patentApplicationNumber`, `leanCanvas`, `simulationReport`, `valuePropositionCanvas`, `prototypeProgressVideo`, `prototypeProgressVideo2`, `projectStatus`, `rejectionReason`, `phaseTwoStatus`, `phaseThreeStatus`, `juryAction`, `createdBy`, `createdDate`, `modifiedBy`, `modifiedDate`, `currentStep`, `phaseOneDataSubmited`, `phaseTwoDataSubmited`, `currentPhase`, `phaseStatus`, `incubateAction`, `marketPotential`, `productReadiness`, `invention`, `technicalProcess`, `impactOnEnvironment`, `numberOfEvals`, `shareWithIncubator`, `incubatorId`, `status`) VALUES
(61, 28, 'SP21C00061', 'Voice Assistant For Visually Impaired.', 5, 6, 'This is an innovative System for visually impaired people and acts as a voice assistant for them. This system is used to help the visually impaired to have access to the most important features of the phone enhancing the quality of the system making use of different custom layouts and using speech to text. The System has custom messaging feature with inbox and sent items, call log and dialer, notes and battery level checking and reminder. ', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Reject', 'You have an ethical concern.', 'Reject', '50', 'Top 10', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(62, 29, 'SP21C00062', 'Face Detection Using Mobile Vision API', 6, 6, 'This System is an innovative Application allowing the System to detect faces using the phones Camera. This system makes use of the Mobile Vision API by Google. The System basically works as follows; the user should take the phone over any picture or anywhere with people, the system using the Mobile Vision detects faces with few attributes such as Happiness, left and right eye in percentage. The User can save all the faces as jpg or png. ', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 1, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(63, 27, 'SP21C00063', 'Watermark Images Using Discrete Cosine Transform', 6, 8, 'Here we proposed a system where you can hide message image into RGB image. Here we used digital watermarking for embedding. Digital watermarking is a technology for embedding various types of information in digital content. A digital watermark is digital signal or pattern inserted into digital content. We had used Discrete Cosine Transform (DCT) for lossy compression of images. Watermarking technique has recently developed for image watermarking and it can be used to embed the information into image and can be efficiently extract back the information. In this system we will hide black and white image under RGB Image and extracts back the black and white image from RGB image. To apply watermarking we must resize the image for further processing. Watermark value will be replaced in block. Finally, system will output original image after removing watermark from image.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 1, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(64, 30, 'SP21C00064', 'Green Power', 8, 6, 'Produce Green energy using green resources. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Approved', 'Test', 'Approved', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(65, 31, 'SP21C00065', 'Mobile Based Attendance System', 5, 6, 'The mobile attendance system has been built to eliminate the time and effort wasted in taking attendances in schools and colleges. It also greatly reduces the amount of paper resources needed in attendance data management.This is an android mobile app. It’s built to be used for school/college faculty so that they may take student attendance on their phones.', 'Student	Login	Done	Valid Scenario Covered\r\n	Registration	Done	Valid Scenario Covered\r\n	Forget Password	Done	Valid Scenario Covered\r\n	User Profile	Done	Valid Scenario Covered\r\n	Idea Submission	Done	Valid Scenario Covered\r\n	Edit Idea Submission	Done	Valid Scenario Covered\r\n	View Project	Done	Pending\r\n	Team Member	Done	Valid Scenario Covered\r\n	Chatter		', 'Student	Login	Done	Valid Scenario Covered\r\n	Registration	Done	Valid Scenario Covered\r\n	Forget Password	Done	Valid Scenario Covered\r\n	User Profile	Done	Valid Scenario Covered\r\n	Idea Submission	Done	Valid Scenario Covered\r\n	Edit Idea Submission	Done	Valid Scenario Covered\r\n	View Project	Done	Pending\r\n	Team Member	Done	Valid Scenario Covered\r\n	Chatter		', 0, 'Rejected', NULL, 'sample-pdf-with-images_4mb(1).pdf', 'sample-pdf-with-images_4mb(3).pdf', 'sample-pdf-with-images_4mb(2).pdf', '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(66, 34, 'SP21C00066', 'Machine Overheat Detection With Alert', 6, 6, 'This proposed system is used to detect temperature of devices that are overheated. This project is very beneficial especially in places like factories or industries consisting of big machines where it is very necessary to take some action in case the machine is overheated. The system uses a digital temperature sensor in order to detect temperature and pass on the data to the microcontroller. The 8051 microcontroller processes data and sends the temperature to be displayed on LCD screen. The display consists of 7 segment display unit to display up to 3 numbers. It consists of 4 push buttons for setting the high and low temperatures. Pressing set button allows user to increment and decrement the temperature of the system. The system uses 12V transformer to supply power to the system. We can set a limit to the temperature and in case if the system exceeds the temperature limit, an alarm rings to indicate that the system has exceeded the set temperature.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 5, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(67, 35, 'SP21C00067', 'Machine Overheat Detection With Alert', 6, 3, 'orem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Reject', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(68, 36, 'SP21C00068', 'Artificial Intelligence HealthCare Chatbot System', 6, 6, 'Through chatbots one can communicate with text or voice interface and get reply through artificial intelligence. Typically, a chat bot will communicate with a real person. Chat bots are used in applications such as ecommerce customer service, call centres and Internet gaming. Chatbots are programs built to automatically engage with received messages. Chatbots can be programmed to respond the same way each time, to respond differently to messages containing certain keywords and even to use machine learning to adapt their responses to fit the situation. A developing number of hospitals, nursing homes, and even private centers, presently utilize online Chatbots for human services on their sites. ', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(69, 37, 'SP21C00069', 'OMNITRACKER Project ', 6, 6, 'A project is a temporary task of greater complexity. Oftentimes several departments across different locations are involved in projects. Companies use project management software to ensure efficient communication between all parties involved during a project.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Hold', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(70, 33, 'SP21C00070', 'Dhiraj Project', 6, 5, 'In this system we have developed a mathematical model for predicting the success class such as flop, hit, super hit of the movies. For doing this we have to develop a methodology in which the historical data of each component such as actor, actress, director, music that influences the success or failure of a movie is given is due to weight age and then based on multiple thresholds calculated on the basis of descriptive statistics of dataset of each component it is given class flop, hit, super hit label. Admin will add the film crew data. ', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 2, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(71, 38, 'SP21C00071', 'Ishaan', 6, 6, 'Gas leakage tragedies and accidents have lead to heavy losses over the years. So it is very important to detect any gas leakage and prevent any accidents. So we here propose a system to detect LPG/CNG gas leakage scenarios and provide a security alert to intended users. We here propose to build the system using a MQ6 gas detection sensor and interface it with Avr family microcontroller along with gsm modem for alerting through buzzer. Our system uses the gas sensor to detect any gas leakages. The gas sensor sends out a signal to microcontroller as soon as it encounters a gas leakage. The microcontroller processes this signal and sends out a signal buzzer and LCD with required message details.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Approved', NULL, '50', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 3, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(72, 40, 'SP21C00072', 'shivani project', 5, 6, 'Theme parks/ national parks as well as other huge tourist attractions need directional guides to inform user about his location I the area. To solve this issue we here propose a park guidance system using rf technology that works wirelessly to guide user about his current location. This proves as a very handy and convenient medium for guiding tourists through the park. This system proposes to replace the you are here boards mounted through such parks.', 'Theme parks/ national parks as well as other huge tourist attractions need directional guides to inform user about his location I the area. To solve this issue we here propose a park guidance system using rf technology that works wirelessly to guide user about his current location. This proves as a very handy and convenient medium for guiding tourists through the park. This system proposes to replace the you are here boards mounted through such parks.', 'Detetcor, rf, temperature detector', 0, '', NULL, 'Jawalkar_Om_Evs_Project.pdf', 'OM_JAWALKAR_EVS_PROJECT.pdf', 'PRADIPANANDRAOYADAV_1253071_-01_04-_1.pdf', '', '', 'Approved', NULL, 'Approved', '50', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 3, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(76, 41, 'SP21C00076', 'Pooja Projects', 6, 2, 'Steganography involves hiding of text, image or any sensitive information inside another image, video or audio in such a way that an attacker will not be able to detect its presence. Steganography is, many times, confused with cryptography as both the techniques are used to secure information. The difference lies in the fact that steganography hides the data so that nothing appears out of ordinary while cryptography encrypts the text, making it difficult for an outsider to infer anything from it even if they do attain the encrypted text.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(78, 45, 'SP21C00078', 'Dilips automative car', 6, 6, 'Steganography involves hiding of text, image or any sensitive information inside another image, video or audio in such a way that an attacker will not be able to detect its presence. Steganography is, many times, confused with cryptography as both the techniques are used to secure information. The difference lies in the fact that steganography hides the data so that nothing appears out of ordinary while cryptography encrypts the text, making it difficult for an outsider to infer anything from it even if they do attain the encrypted text.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(79, 47, 'SP21C00079', 'Kadambari Project', 6, 6, 'Steganography involves hiding of text, image or any sensitive information inside another image, video or audio in such a way that an attacker will not be able to detect its presence. Steganography is, many times, confused with cryptography as both the techniques are used to secure information. The difference lies in the fact that steganography hides the data so that nothing appears out of ordinary while cryptography encrypts the text, making it difficult for an outsider to infer anything from it even if they do attain the encrypted text.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(80, 46, 'SP21C00080', 'Darshan Project', 6, 6, 'The project is a speed checker system that can detect rash driving and any kind of speed violation on highways and alert the traffic authorities. The conventional system uses a handheld radar gun which is aimed at the vehicle to record its speed and if there is any speed violation, nearest police station is informed.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
