(87, 55, 'SP21C00087', 'Meera Project', 5, 5, 'The objective of this project is to monitor the flood situation & send alert in case of danger in the form of text message. The main objective of this project is to detect rising water level in a river at a reasonable distance from the rail track/ roadways and intimate that to the respective authorities through SMS, to take appropriate action.', 'There is one central PC to which we connect a mobile using serial or USB port through F bus or DATA cable. The person to whom we wish to track via mobile, his mobile must be GPS enabled & J2ME based.', 'J2ME, central PC, DATA cable', 0, '', NULL, 'sample-pdf-with-images_4mb(1).pdf', NULL, 'sample-pdf-with-images_4mb(2).pdf', '', '', 'Approved', 'The project is outside of your expertise.', 'Approved', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 3, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(88, 57, 'SP21C00088', 'Vetal Project', 6, 6, 'There is one central PC to which we connect a mobile using serial or USB port through F bus or DATA cable. The person to whom we wish to track via mobile, his mobile must be GPS enabled & J2ME based.When user clicks on a search button the SMS is automatically sent to GPS mobile & automatic feedback will sent by GPS mobile. And that will be caught by central pc in which we get the longitude & latitude of that area.', 'This type of SMS’s are sent frequently to that person’s mobile from the mobile which is connected to the central PC. Such sms’s are frequently sent and the feedback gets us the current time, date, longitude & latitude which gets stored in database. All this database info goes into the java script which computes the position of the person by longitude & latitude axis point in the Google map', 'RFID,  GPS', 0, '', NULL, 'sample-pdf-with-images_4mb.pdf', NULL, 'OM_JAWALKAR_EVS_PROJECT-converted-converted.pdf', '', '', 'Approved', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(89, 54, 'SP21C00089', 'Siddhart Project', 6, 4, 'This project intends to maximize the password space, while facilitating memorization of entered secrets. Graphical passwords system is more difficult to be cracked by using the traditional attack methods such as brute force search, dictionary, social engineering and spyware attack. As a result the security level of this system is good. However, there are still some minor drawbacks in this system. They are vulnerable to shoulder surfing problem. But this drawback is negligible compared to the advantages provided by this graphical password system.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', 'Approved', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
