(92, 58, 'SP21C00092', 'Prachiti Face detection system', 6, 6, 'SQL injection attack is widely used by attackers to gain unauthorized access to systems. This software system is developed to prevent unauthorized access to system using SQL injection attacks. This is done by adding unique value and a signature based authentication technique to verify authenticity. SQL injection is a major security issue these days that allows an attacker to gain access of a web system or application exploiting certain vulnerabilities.SQL injection attack is widely used by attackers to gain unauthorized access to systems. This software system is developed to prevent unauthorized access to system using SQL injection attacks. This is done by adding unique value and a signature based authentication technique to verify authenticity. SQL injection is a major security issue these days that allows an attacker to gain access of a web system or application exploiting certain vulnerabilities.SQL injection attack is widely used by attackers to gain unauthorized access to systems.', 'This project presents the concept to design a verticalo c', 'Wind and Solar Energy, Hybrid E This project presents the concept to design a vertical wind turbine having a solar panel mounted over it which will capture the air produced by the vehicles travelling o This project presents the concept to design a vertical wind turbine having a solar panel mounted over it which will capture the air produced by the vehicles travelling o', 0, '', NULL, 'Foundation-Mock-Instruction-D-21__4_.pdf', 'file-example_PDF_1MB(2).pdf', 'file-example_PDF_1MB(1).pdf', 'SampleVideo_1280x720_1mb.mp4', '', 'Approved', NULL, 'Approved', 'top50', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 1, 3, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(93, 60, 'SP21C00093', 'Summit Project', 5, 10, 'The project is designed to monitor the counting operations in industries. For example, products moving on a conveyor belt are counted by IR interruption concept and displayed on a seven segment display.\nThere are two pair sensors, each kept at certain distance from the other. One pair of sensor consists of a transmitter and a receiver, kept exactly opposite to each other. The transmitting part emits modulated IR light which is received at the receiver end and fed to a microcontroller of 8051 family. When an object passes through the sensors then microcontroller gets interrupt signal (from IR sensors) and increments the count to displays it on 7 segments displays. Count down is also achieved if the object moves in reverse direction. ', 'technical description', 'project keyword', 0, '', NULL, 'Shri__Om_Raut.pdf', 'novelty-bank-statement.pdf', 'ThankingLetter.pdf', '', '', 'Hold', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(94, 61, 'SP21C00094', 'Vaibhav Project', 6, 6, 'Triple DES is advantageous because it has a significantly sized key length, which is longer than most key lengths affiliated with other encryption modes. It derives from single DES but the technique is used in triplicate and involves three sub keys and key padding when necessary, such as instances where the keys must be increased to 64 bits in length. Known for its compatibility and flexibility, software can easily be converted for Triple DES inclusion. Triple DES encrypts input data three times. The three keys are referred to as k1, k2 and k3.', 'Technical Description', 'Keyword', 0, '', NULL, 'Simulation_Report.pdf', 'sample-pdf-with-images_4mb(1).pdf', 'VALUE_PROPOSITION_CANVAS.pdf', '', '', 'Approved', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(95, 63, 'SP21C00095', 'Dhruvi  Xbee Transformer/Generator Health Monitor ProjectXbee Transformer/Generator Health Monitor Project', 6, 6, 'Our proposed project aims at remotely getting the information on distribution transformers using a GSM modem or Xbee. This application requires a temperature sensor, three potential transformers along with three current transformers. They work together to monitor three parameters of a generator/transformer and send this data to remote location.', NULL, NULL, 0, '', NULL, NULL, NULL, NULL, '', '', '', NULL, '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 0, 0, 1, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
(96, 64, 'SP21C00096', 'Sagar Project SMS Controlled Railway Level Gate Control With Programmable Numbers', 6, 6, 'The project provides a system that allows user to operate the railway level crossing gate through sms sent by operator/incharge. The operation of the railway level crossing is usually operated manually or through wired electronic media. A person needs to be present to operate it from the control room by pulling a lever or button.\nThe system allows operation of railway level crossing through SMS thus allowing user to operate it from any range, anywhere in the world. Operator may open and close railway crossing gate from any where through a simple sms.\nThis functionality is achieved through a Gsm modem interfaced to the System that reads the sms commands from user. Suppose if the operator sends a close message it is recognized by the modem and instructs the motor to close the gate.', 'Technical Descriptions', 'KPIT, Sparkle', 0, '', NULL, 'file-example_PDF_1MB(1).pdf', NULL, 'VALUE_PROPOSITION_CANVAS.pdf', '', '', 'Approved', 'Test', '', '', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 0, 2, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'active'),
