(113, 78, 'SP21C00113', 'Aditya Project Fraud app detection software', 6, 6, 'Both Apple Store and PlayStore are replete with fraudulent apps. Malicious apps can not only damage the phone’s normal functioning but also access and misuse sensitive data stored on the phone. Here, you’ll develop software that can process the information, comments, and user review of apps in Apple Store/PlayStore to determine whether or not it is a genuine app. The software can process multiple applications simultaneously. Aarti Jawalkar\n\n', 'Technical Description The gender and age detection application is a popular Data Science final year project that helps strengthen your programming skills. For developing the gender and age detection project, you will need Python, Support Vector Machine, and Convolutional Neural Network. Fortunately, you’ll get plenty of datasets for training the model. As the name suggests, the application can predict an individual’s gender and age through image recognition. Thus, once you feed a person’s image into the model, it will display their gender and age. ', 'In this project, you will develop an emotion recognition system with integrated audio input. It is a simple yet practical final year project for students to build their real-world skills. The components required for this project include Python, Support Vector Machine, RNN algorithm, and Convolutional Neural Network. You can use the Vox celebrity dataset having different voice samples for training the model, while the Librosa package can be used to extract and classify audio samples. It is an excellent application for people with a hearing impairment.', 1, 'Approved', '1234567890ABC', 'lean-canvas1(2).pdf', 'sample-pdf-file.pdf', 'SIMULATIONREPORT(1).pdf', 'file_example_MP4_480_1_5MG.mp4', 'file_example_MP4_480_1_5MG(1).mp4', 'Approved', NULL, 'Approved', 'top50', '', 0, '0000-00-00', 0, '0000-00-00', 6, 1, 1, 3, 'pending', 'Select', NULL, NULL, NULL, NULL, NULL, NULL, 'Yes', 152, 'active'),
