(413, 99, 65, 78, 'While running we need to carry our smartphone or smart watches to take the count of our distance covered and calories burned, which is just a extra burden for a person while running and for some it is also so expensive to buy those watches or phones. And in some incidents due to water, sweat or other physical reasons the electronic appliances had got damaged, so there is the need to replace these electronic item with one efficient material.', '', '', '', 'active'),
(414, 99, 65, 90, 'The SMART SHOES will be the solution for this problem, these shoes will have embedded sensors in its sole which will count the distance covered while running and a microprocessor chip which will frame out the calories burnt after checking out the distance covered and all this will be displayed on small screen fitted into sole. Thus this will not only remove the extra burden while running but will be favorable for peoples who can\'t buy smart phone or watches', '', '', '', 'active'),
(415, 99, 65, 99, 'The invention is that the sensors and chips will be used in shoes and coding will be done on chip to count out calories burned after sensors measured out distance covered, and the result will be displayed on screen TRL 3', '', '', '', 'active'),
