(838, 129, 158, 78, 'Problem Statement archana It\'s important to document all of the resources you had mapped out in your project plan. What do you have left still available? What have you used and found insufficient? Of what resources do you need more? This can include project management tools and physical resources like software or a PDF, but also human resources.\r\n\r\n', '', '', '', 'active'),
